INSERT INTO `lite_flow_script` VALUES ('1771160040651698177', 'admin', '2024-05-01 00:00:00', 'admin', '2024-05-01 00:00:00', 'A01', '查询ICP备案信息', 'script', 'import com.alibaba.fastjson.JSONObject;\nimport com.yomahub.liteflow.script.ScriptExecuteWrap;\nimport com.yomahub.liteflow.script.body.CommonScriptBody;\nimport com.yomahub.liteflow.spi.holder.ContextAwareHolder;\nimport testnet.client.service.ILiteFlowMessageSendService;\nimport testnet.common.dto.DomainToCompanyDTO;\nimport testnet.common.entity.HttpResponse;\nimport testnet.common.entity.liteflow.TaskExecuteMessage;\nimport testnet.common.utils.HttpUtils;\n\n/**\n * 脚本名称：查询ICP备案信息\n * 适用资产：域名\n * 配置：\n * 结果处理类名: domainToCompanyProcessor\n */\npublic class ICPApi2 implements CommonScriptBody {\n    public Void body(ScriptExecuteWrap wrap) {\n        TaskExecuteMessage taskExecuteMessage = wrap.cmp.getRequestData();\n        ILiteFlowMessageSendService sendService = ContextAwareHolder.loadContextAware().getBean(ILiteFlowMessageSendService.class);\n        JSONObject instanceParams = JSONObject.parseObject(taskExecuteMessage.getTaskParams());\n        sendService.setTaskId(taskExecuteMessage.getTaskId());\n        sendService.INFO(\"开始查询ICP备案信息\");\n\n        try {\n            String domain = instanceParams.getString(\"domain\");\n            // 调用新的 ICP 查询接口\n            HttpResponse response = HttpUtils.get(\"https://api.leafone.cn/api/icp?name=\"+domain);\n\n            if (response.getStatusCode() == 200) {\n                sendService.INFO(\"查询备案成功，返回包: {}\", response.getBody());\n                JSONObject responseBody = JSONObject.parseObject(response.getBody());\n                if (responseBody.getInteger(\"code\") == 200) {\n                    JSONObject data = responseBody.getJSONObject(\"data\");\n                    String companyName = data.getJSONArray(\"list\").getJSONObject(0).getString(\"unitName\");\n                    String icpNumber = data.getJSONArray(\"list\").getJSONObject(0).getString(\"mainLicence\");\n                    DomainToCompanyDTO domainToCompanyDTO = new DomainToCompanyDTO();\n                    domainToCompanyDTO.setIcpNumber(icpNumber);\n                    domainToCompanyDTO.setCompanyName(companyName);\n                    sendService.sendResult(domainToCompanyDTO);\n                } else {\n                    sendService.ERROR(\"查询备案失败！返回错误信息：{}\", responseBody.getString(\"msg\"));\n                }\n            } else {\n                sendService.ERROR(\"查询备案失败！请求状态码：{}\", response.getStatusCode());\n            }\n        } catch (Exception e) {\n            sendService.ERROR(\"查询备案失败！ 错误信息：{}\", e.getMessage());\n            throw new RuntimeException(\"ICP查询接口调用失败\", e);\n        }\n        return null;\n    }\n}', 'java', 1, 'testnet-client', 'icp1', 'API', NULL, 0, NULL);
INSERT INTO `lite_flow_script` VALUES ('1773261756402544642', 'admin', '2024-05-01 00:00:00', 'admin', '2024-05-01 00:00:00', 'A01', 'httpx探测Web资产', 'script', 'import com.alibaba.fastjson.JSONArray;\nimport com.alibaba.fastjson.JSONObject;\nimport com.yomahub.liteflow.script.ScriptExecuteWrap;\nimport com.yomahub.liteflow.script.body.CommonScriptBody;\nimport com.yomahub.liteflow.spi.holder.ContextAwareHolder;\nimport org.apache.commons.lang.StringUtils;\nimport testnet.client.service.ILiteFlowMessageSendService;\nimport testnet.client.util.TencentCOSUtils;\nimport testnet.common.dto.IpOrSubDomainOrPortToWebDTO;\nimport testnet.common.entity.liteflow.TaskExecuteMessage;\nimport testnet.common.utils.CommandUtils;\n\nimport java.nio.file.Files;\nimport java.nio.file.Paths;\nimport java.util.HashMap;\nimport java.util.Map;\nimport java.util.UUID;\n\n/**\n * 脚本名称：httpx web探测\n * 适用资产：端口、子域名、IP\n * 配置：\n * command: \'httpx -disable-update-check -no-stdin -hash md5 -favicon -jarm -cdn -json -cname -title -threads 100 -timeout 3 -verbose -location -web-server -status-code -tech-detect -content-type -content-length -irh  -u %s -o \'\n * enableScreenshot: false\n * secretId: AKIxxxx\n * secretKey: xxx\n * bucketName: xxx\n * regionName: ap-xxx\n * 结果处理类名: ipOrSubDomainOrPortToWebProcessor\n */\npublic class Httpx implements CommonScriptBody {\n\n    private ILiteFlowMessageSendService messageSendService;\n\n    public Void body(ScriptExecuteWrap wrap) {\n        TaskExecuteMessage taskExecuteMessage = wrap.cmp.getRequestData();\n        try {\n            messageSendService = ContextAwareHolder.loadContextAware().getBean(ILiteFlowMessageSendService.class);\n            messageSendService.setTaskId(taskExecuteMessage.getTaskId());\n            messageSendService.INFO(\"开始httpx web探测...\");\n            JSONObject config = JSONObject.parseObject(taskExecuteMessage.getConfig());\n            JSONObject jsonObject = JSONObject.parseObject(taskExecuteMessage.getTaskParams());\n            String resultPath = taskExecuteMessage.getResultPath() + \"httpx_\" + UUID.randomUUID() + \".json\";\n            messageSendService.INFO(\"结果保存路径:{}\", resultPath);\n            String command = config.getString(\"command\");\n            if (config.getBoolean(\"enableScreenshot\")) {\n                command = command + \" -screenshot -exclude-headless-body\";\n            }\n            Map<String, String> taskList = new HashMap<>();\n            switch (taskExecuteMessage.getAssetType()) {\n                case \"port\":\n                    // 端口\n                    JSONArray domains = jsonObject.getJSONArray(\"domains\");\n                    if (domains != null && !domains.isEmpty()) {\n                        for (Object domain : domains) {\n                            JSONObject object = (JSONObject) domain;\n                            String subDomain = object.getString(\"subDomain\");\n                            if (StringUtils.isNotBlank(subDomain)) {\n                                resultPath = taskExecuteMessage.getResultPath() + \"httpx_\" + UUID.randomUUID() + \".json\";\n                                taskList.put(subDomain, String.format(command, subDomain + \":\" + jsonObject.getString(\"port\"), resultPath));\n                            }\n                        }\n                    } else {\n                        String ip = jsonObject.getString(\"ip_dictText\");\n                        taskList.put(\"\", String.format(command, ip + \":\" + jsonObject.getString(\"port\"), resultPath));\n                    }\n                    break;\n                case \"sub_domain\":\n                    // 域名\n                    String sub_domain = jsonObject.getString(\"subDomain\");\n                    taskList.put(sub_domain, String.format(command, sub_domain, resultPath));\n                    break;\n                case \"ip\":\n                    // ip\n                    String ip = jsonObject.getString(\"ip\");\n                    taskList.put(\"\", String.format(command, ip, resultPath));\n                    break;\n                default:\n                    messageSendService.ERROR(\"不支持的资产类型!:{}\", taskExecuteMessage.getAssetType());\n                    break;\n            }\n            for (String s : taskList.keySet()) {\n                executeTask(s, taskList.get(s), config, resultPath);\n            }\n        } catch (\n                Exception e) {\n            throw new RuntimeException(e);\n        }\n        return null;\n    }\n\n    private void executeTask(String domain, String task, JSONObject config, String resultPath) {\n        try {\n            messageSendService.INFO(\"开始执行Web扫描,命令是:{}\", task);\n            CommandUtils.CommandResult result = CommandUtils.executeCommand(task);\n            if (result.getExitCode() == 0) {\n                String resultContent = new String(Files.readAllBytes(Paths.get(resultPath)));\n                JSONObject resultJson = JSONObject.parseObject(resultContent);\n                if (resultJson != null) {\n                    IpOrSubDomainOrPortToWebDTO ipOrSubDomainOrPortToWebDTO = (IpOrSubDomainOrPortToWebDTO) JSONObject.parseObject(resultContent, IpOrSubDomainOrPortToWebDTO.class);\n                    ipOrSubDomainOrPortToWebDTO.setDomain(domain);\n                    ipOrSubDomainOrPortToWebDTO.setWebUrl(resultJson.getString(\"url\"));\n                    ipOrSubDomainOrPortToWebDTO.setHttpSchema(resultJson.getString(\"scheme\"));\n                    ipOrSubDomainOrPortToWebDTO.setDelayTime(resultJson.getString(\"time\"));\n                    ipOrSubDomainOrPortToWebDTO.setIp(resultJson.getString(\"host\"));\n                    ipOrSubDomainOrPortToWebDTO.setWebHeader(resultJson.getString(\"header\"));\n                    ipOrSubDomainOrPortToWebDTO.setWebTitle(resultJson.getString(\"title\"));\n                    JSONObject hash = resultJson.getJSONObject(\"hash\");\n                    ipOrSubDomainOrPortToWebDTO.setBodyMd5(hash.getString(\"body_md5\"));\n                    ipOrSubDomainOrPortToWebDTO.setHeaderMd5(hash.getString(\"header_md5\"));\n                    ipOrSubDomainOrPortToWebDTO.setSource(\"httpx\");\n                    JSONArray tech = resultJson.getJSONArray(\"tech\");\n                    if (tech != null) {\n                        JSONArray jsonArray = new JSONArray();\n                        for (Object o : tech) {\n                            JSONObject jsonObject = new JSONObject();\n                            jsonObject.put(\"name\", o.toString());\n                            jsonArray.add(jsonObject);\n                        }\n                        ipOrSubDomainOrPortToWebDTO.setTech(JSONObject.toJSONString(jsonArray));\n                    }\n                    if (config.getBoolean(\"enableScreenshot\")) {\n                        String secretId = config.getString(\"secretId\");\n                        String secretKey = config.getString(\"secretKey\");\n                        String bucketName = config.getString(\"bucketName\");\n                        String regionName = config.getString(\"regionName\");\n                        String screenshot_path = resultJson.getString(\"screenshot_path\");\n                        String screenshot_path_rel = resultJson.getString(\"screenshot_path_rel\");\n                        if (screenshot_path != null && screenshot_path_rel != null) {\n                            ipOrSubDomainOrPortToWebDTO.setScreenshot(TencentCOSUtils.uploadTencentCOS(secretId, secretKey, bucketName, regionName, screenshot_path, screenshot_path_rel));\n                        }\n                        String stored_response_path = resultJson.getString(\"stored_response_path\");\n                        if (stored_response_path != null) {\n                            String path = UUID.randomUUID() + \".txt\";\n                            messageSendService.INFO(\"Httpx返回包存储路径：{}\", path);\n                            ipOrSubDomainOrPortToWebDTO.setResponseBody(TencentCOSUtils.uploadTencentCOS(secretId, secretKey, bucketName, regionName, stored_response_path, path));\n                        }\n                    } else {\n                        messageSendService.INFO(\"Httpx Web扫描执行完成,结果是:{}\", resultJson);\n                    }\n                    messageSendService.sendResult(ipOrSubDomainOrPortToWebDTO);\n                } else {\n                    messageSendService.INFO(\"Httpx Web扫描执行完成,结果为空\");\n                }\n            } else {\n                messageSendService.ERROR(\"执行Httpx Web扫描执行失败,错误码是:{}\", result.getExitCode());\n            }\n        } catch (Exception e) {\n            messageSendService.ERROR(\"执行Httpx Web扫描执行失败,错误:{}\", e.getMessage());\n        }\n    }\n}', 'java', 1, 'testnet-client', 'httpx', 'PING', 'httpx -version 2>&1 | grep -oP \'Current Version: \\Kv?\\d+\\.\\d+\\.\\d+\'', 1, 'apt update\napt install -y ttf-wqy-microhei ttf-wqy-zenhei\nwget https://dl.google.com/linux/direct/google-chrome-stable_current_amd64.deb\napt install -y ./google-chrome-stable_current_amd64.deb\nrm -f ./google-chrome-stable_current_amd64.deb');
INSERT INTO `lite_flow_script` VALUES ('1773680693413994497', 'admin', '2024-05-01 00:00:00', 'admin', '2024-05-01 00:00:00', 'A01', 'oneforall子域名扫描', 'script', 'import com.alibaba.fastjson.JSON;\nimport com.alibaba.fastjson.JSONArray;\nimport com.alibaba.fastjson.JSONObject;\nimport com.yomahub.liteflow.script.ScriptExecuteWrap;\nimport com.yomahub.liteflow.script.body.CommonScriptBody;\nimport com.yomahub.liteflow.spi.holder.ContextAwareHolder;\nimport testnet.client.service.ILiteFlowMessageSendService;\nimport testnet.common.dto.DomainToSubdomainsAndIpsDTO;\nimport testnet.common.entity.liteflow.TaskExecuteMessage;\nimport testnet.common.utils.CommandUtils;\n\nimport java.nio.file.Files;\nimport java.nio.file.Paths;\nimport java.util.ArrayList;\nimport java.util.List;\nimport java.util.UUID;\n\n/**\n * 脚本名称：OneForAll子域名扫描\n * 适用资产：域名\n * 配置：\n * command: \'python3 /testnet-client/OneForAll/oneforall.py --target %s --req False --fmt json --path %s run\'\n * 结果处理类名: domainToSubDomainAndIPProcessor\n */\npublic class OneForAll implements CommonScriptBody {\n    public Void body(ScriptExecuteWrap wrap) {\n        TaskExecuteMessage taskExecuteMessage = wrap.cmp.getRequestData();\n        JSONObject instanceParams = JSONObject.parseObject(taskExecuteMessage.getTaskParams());\n        JSONObject config = JSONObject.parseObject(taskExecuteMessage.getConfig());\n        try {\n            ILiteFlowMessageSendService sendService = ContextAwareHolder.loadContextAware().getBean(ILiteFlowMessageSendService.class);\n            sendService.setTaskId(taskExecuteMessage.getTaskId());\n            String domain = instanceParams.getString(\"domain\");\n            String resultPath = taskExecuteMessage.getResultPath() + \"oneforall_\" + UUID.randomUUID() + \".json\";\n            sendService.INFO(\"结果保存路径:{}\", resultPath);\n            String command = config.getString(\"command\");\n            command = String.format(command, domain, resultPath);\n            sendService.INFO(\"开始执行OneForAll,命令是:{}\", command);\n            CommandUtils.CommandResult result = CommandUtils.executeCommand(command);\n            sendService.INFO(\"开始解析OneForAll结果\");\n            if (result.getExitCode() == 0) {\n                sendService.INFO(\"执行成功,输出结果: {}\", result.getOutput());\n                String jsonContent = new String(Files.readAllBytes(Paths.get(resultPath)));\n                JSONArray jsonArray = JSON.parseArray(jsonContent);\n                DomainToSubdomainsAndIpsDTO domainToSubdomainsAndIpsDTO = new DomainToSubdomainsAndIpsDTO();\n                List<DomainToSubdomainsAndIpsDTO.SudDomain> subDomainList = getSudDomains(jsonArray);\n                domainToSubdomainsAndIpsDTO.setSubDomainList(subDomainList);\n                sendService.sendResult(domainToSubdomainsAndIpsDTO);\n            } else {\n                sendService.ERROR(\"执行失败,输出结果: {}\", result.getOutput());\n            }\n        } catch (Exception e) {\n            throw new RuntimeException(e);\n        }\n        return null;\n    }\n\n    private List<DomainToSubdomainsAndIpsDTO.SudDomain> getSudDomains(JSONArray jsonArray) {\n        List<DomainToSubdomainsAndIpsDTO.SudDomain> subDomainList = new ArrayList<>();\n        for (Object o : jsonArray) {\n            JSONObject jsonObject = (JSONObject) o;\n            DomainToSubdomainsAndIpsDTO.SudDomain sudDomain = new DomainToSubdomainsAndIpsDTO.SudDomain();\n            sudDomain.setLevel(jsonObject.getInteger(\"level\"));\n            sudDomain.setSubDomain(jsonObject.getString(\"subdomain\"));\n            sudDomain.setIpList(jsonObject.getString(\"ip\"));\n            sudDomain.setSource(\"OneForAll-\" + \":\" + jsonObject.getString(\"source\"));\n            subDomainList.add(sudDomain);\n        }\n        return subDomainList;\n    }\n\n}', 'java', 1, 'testnet-client', 'oneforall', 'SUBDOMAIN', 'python3 /testnet-client/default_tools/OneForAll/oneforall.py version 2>&1 | grep -oP \'v\\d+\\.\\d+\\.\\d+\'', 1, '');
INSERT INTO `lite_flow_script` VALUES ('1773681041704804353', 'admin', '2024-05-01 00:00:00', 'admin', '2024-05-01 00:00:00', 'A01', 'Naabu端口扫描', 'script', 'import com.alibaba.fastjson.JSONObject;\nimport com.yomahub.liteflow.script.ScriptExecuteWrap;\nimport com.yomahub.liteflow.script.body.CommonScriptBody;\nimport com.yomahub.liteflow.spi.holder.ContextAwareHolder;\nimport testnet.client.service.ILiteFlowMessageSendService;\nimport testnet.common.dto.AssetUpdateDTO;\nimport testnet.common.dto.IpOrSubDomainToPortDTO;\nimport testnet.common.entity.liteflow.TaskExecuteMessage;\nimport testnet.common.utils.CommandUtils;\n\nimport java.io.BufferedReader;\nimport java.io.FileReader;\nimport java.nio.file.Paths;\nimport java.util.ArrayList;\nimport java.util.List;\nimport java.util.UUID;\n\n\n/**\n * 脚本名称：Naabu 端口扫描\n * 适用资产：子域名、IP\n * 配置：\n * command: \'naabu -no-stdin -c 200 -json -top-ports 100 -host %s -o %s\'\n * 结果处理类名: ipOrSubDomainToPortProcessor\n */\npublic class Naabu implements CommonScriptBody {\n\n    public Void body(ScriptExecuteWrap wrap) {\n        // 获取的是chain初始化的参数\n        TaskExecuteMessage taskExecuteMessage = wrap.cmp.getRequestData();\n        try {\n            ILiteFlowMessageSendService messageSendService = ContextAwareHolder.loadContextAware().getBean(ILiteFlowMessageSendService.class);\n            messageSendService.setTaskId(taskExecuteMessage.getTaskId());\n            JSONObject config = JSONObject.parseObject(taskExecuteMessage.getConfig());\n            JSONObject instanceParams = JSONObject.parseObject(taskExecuteMessage.getTaskParams());\n            String resultPath = taskExecuteMessage.getResultPath() + \"naabu_\" + UUID.randomUUID() + \".json\";\n            messageSendService.INFO(\"结果保存路径:{}\", resultPath);\n            String command = config.getString(\"command\");\n            String asset = \"\";\n            switch (taskExecuteMessage.getAssetType()) {\n                case \"ip\":\n                    asset = instanceParams.getString(\"ip\");\n                    command = String.format(command, asset, resultPath);\n                    break;\n                case \"sub_domain\":\n                    asset = instanceParams.getString(\"subDomain\");\n                    command = String.format(command, asset, resultPath);\n                    break;\n                case \"port\":\n                    asset = instanceParams.getString(\"ip\") + \":\" + instanceParams.getString(\"port\");\n                    command = String.format(command, instanceParams.getString(\"ip\"), resultPath, instanceParams.getString(\"port\"));\n            }\n            messageSendService.INFO(\"开始执行Nabbu端口扫描,命令是:{}\", command);\n            CommandUtils.CommandResult result = CommandUtils.executeCommand(command);\n            if (result.getExitCode() == 0) {\n                if (taskExecuteMessage.getAssetType().equals(\"port\")) {\n                    AssetUpdateDTO assetUpdateDTO = new AssetUpdateDTO();\n                    instanceParams.put(\"isOpen\", \"Y\");\n                    assetUpdateDTO.setData(instanceParams.toString());\n                    messageSendService.sendResult(assetUpdateDTO);\n                } else {\n                    BufferedReader reader = new BufferedReader(new FileReader(Paths.get(resultPath).toFile()));\n                    String line;\n                    IpOrSubDomainToPortDTO dto = new IpOrSubDomainToPortDTO();\n                    List<IpOrSubDomainToPortDTO.Port> portList = new ArrayList<>();\n                    while ((line = reader.readLine()) != null) {\n                        // 处理每一行内容\n                        JSONObject jsonObject = JSONObject.parseObject(line);\n                        messageSendService.INFO(\"Nabbu端口扫描执行结果:{}\", jsonObject);\n                        if (jsonObject != null) {\n                            IpOrSubDomainToPortDTO.Port port = new IpOrSubDomainToPortDTO.Port();\n                            port.setPort(jsonObject.getInteger(\"port\"));\n                            port.setProtocol(jsonObject.getString(\"protocol\"));\n                            port.setIp(jsonObject.getString(\"ip\"));\n                            port.setHost(jsonObject.getString(\"host\"));\n                            portList.add(port);\n                        }\n                    }\n                    dto.setPortList(portList);\n                    messageSendService.sendResult(dto);\n                }\n            } else if (result.getExitCode() == 1) {\n                messageSendService.INFO(\"资产: {} 端口扫描完成，没有端口开放\", asset);\n                if (taskExecuteMessage.getAssetType().equals(\"port\")) {\n                    AssetUpdateDTO assetUpdateDTO = new AssetUpdateDTO();\n                    instanceParams.put(\"isOpen\", \"N\");\n                    assetUpdateDTO.setData(instanceParams.toString());\n                    messageSendService.sendResult(assetUpdateDTO);\n                }\n            } else {\n                messageSendService.ERROR(\"Nabbu端口扫描执行失败,错误信息是:{}\", result.getExitCode());\n            }\n        } catch (Exception e) {\n            throw new RuntimeException(e);\n        }\n        return null;\n    }\n}', 'java', 1, 'testnet-client', 'naabu', 'PORT', 'naabu -version 2>&1 | grep -oP \'Current Version: \\K\\d+\\.\\d+\\.\\d+\'', 1, '');
INSERT INTO `lite_flow_script` VALUES ('1777529130056232961', 'admin', '2024-05-01 00:00:00', 'admin', '2024-05-01 00:00:00', 'A01', '零零信安-公司查询根域名', 'script', 'import com.alibaba.fastjson.JSON;\nimport com.alibaba.fastjson.JSONArray;\nimport com.alibaba.fastjson.JSONObject;\nimport com.yomahub.liteflow.script.ScriptExecuteWrap;\nimport com.yomahub.liteflow.script.body.CommonScriptBody;\nimport com.yomahub.liteflow.spi.holder.ContextAwareHolder;\nimport testnet.client.service.ILiteFlowMessageSendService;\nimport testnet.common.dto.CompanyToDomainsDTO;\nimport testnet.common.entity.HttpResponse;\nimport testnet.common.entity.liteflow.TaskExecuteMessage;\nimport testnet.common.utils.HttpUtils;\n\nimport java.util.ArrayList;\nimport java.util.HashMap;\nimport java.util.List;\nimport java.util.Map;\n\npublic class Zone implements CommonScriptBody {\n\n    public Void body(ScriptExecuteWrap wrap) {\n        TaskExecuteMessage taskExecuteMessage = wrap.cmp.getRequestData();\n        JSONObject config = JSONObject.parseObject(taskExecuteMessage.getConfig());\n        String key = config.getString(\"zone_key\");\n        JSONObject instanceParams = JSONObject.parseObject(taskExecuteMessage.getTaskParams());\n        ILiteFlowMessageSendService sendService = ContextAwareHolder.loadContextAware().getBean(ILiteFlowMessageSendService.class);\n        sendService.setTaskId(taskExecuteMessage.getTaskId());\n        sendService.INFO(\"开始执行0.zone,参数是: {}\", taskExecuteMessage.getTaskParams());\n        String componentName = instanceParams.getString(\"companyName\");\n        int startPage = 1;\n        int pageSize = 100;\n        JSONObject result = query(componentName, key, startPage, pageSize);\n        List<CompanyToDomainsDTO.Domain> domainList = new ArrayList<>();\n        CompanyToDomainsDTO companyToDomainsDTO = new CompanyToDomainsDTO();\n        if (result != null && result.getInteger(\"code\") == 0) {\n            int totalPages = (result.getInteger(\"total\") + pageSize - 1) / pageSize;\n            sendService.INFO(\"结果总数量: {}，分页数量:{}\", result.getInteger(\"total\"), totalPages);\n\n            // 处理第1页数据\n            sendService.INFO(\"正在查询第 1 页...\");\n            domainList.addAll(processResult(result.getJSONArray(\"data\")));\n            sendService.INFO(\"查询结果: {}\", result);\n            sendService.INFO(\"API剩余额度: {}\", result.getJSONObject(\"today_api_search_count\"));\n\n            for (int currentPage = 2; currentPage <= totalPages; currentPage++) {\n                try {\n                    Thread.sleep(1000L); // 暂停1秒\n                } catch (InterruptedException e) {\n                    throw new RuntimeException(e);\n                }\n\n                result = query(componentName, key, currentPage, pageSize);\n                if (result == null || result.getInteger(\"code\") != 0) {\n                    sendService.ERROR(\"查询失败,返回结果: {}\", result);\n                    break;\n                }\n                sendService.INFO(\"正在查询第 {} 页...\", currentPage);\n                sendService.INFO(\"查询结果: {}\", result);\n                sendService.INFO(\"API剩余额度: {}\", result.getJSONObject(\"today_api_search_count\"));\n                domainList.addAll(processResult(result.getJSONArray(\"data\")));\n            }\n        } else {\n            sendService.ERROR(\"查询失败,返回结果: {}\", result);\n        }\n        companyToDomainsDTO.setDomainList(domainList);\n        sendService.sendResult(companyToDomainsDTO);\n        return null;\n    }\n\n    private List<CompanyToDomainsDTO.Domain> processResult(JSONArray jsonArray) {\n        List<CompanyToDomainsDTO.Domain> domainList = new ArrayList<>();\n        for (Object o : jsonArray) {\n            JSONObject domain = (JSONObject) o;\n            CompanyToDomainsDTO.Domain domain1 = new CompanyToDomainsDTO.Domain();\n            domain1.setDomain(domain.getString(\"domain\"));\n            domain1.setIcp(domain.getString(\"icp\"));\n            domainList.add(domain1);\n        }\n        return domainList;\n    }\n\n    private JSONObject query(String companyName, String key, int page, int pageSize) {\n        try {\n            String query = String.format(\"company=%s&&level=根域\", companyName);\n            String postEndpoint = \"https://0.zone/api/data/\";\n            JSONObject body = new JSONObject();\n            body.put(\"query\", query);\n            body.put(\"query_type\", \"domain\");\n            body.put(\"page\", page);\n            body.put(\"pagesize\", pageSize);\n            body.put(\"zone_key_id\", key);\n            Map<String, String> headers = new HashMap<>();\n            headers.put(\"Content-Type\", \"application/json\");\n            HttpResponse response = HttpUtils.post(postEndpoint, headers, body.toJSONString());\n            if (response.getStatusCode() == 200) {\n                return JSON.parseObject(response.getBody());\n            } else {\n                return null;\n            }\n        } catch (Exception e) {\n            throw new RuntimeException(e);\n        }\n    }\n\n}', 'java', 1, 'testnet-client', 'zone', 'API', NULL, 0, NULL);
INSERT INTO `lite_flow_script` VALUES ('1781286631852261378', 'admin', '2024-05-01 00:00:00', 'admin', '2024-05-01 00:00:00', 'A01', 'nuclei漏洞扫描', 'script', 'import com.alibaba.fastjson.JSON;\nimport com.alibaba.fastjson.JSONArray;\nimport com.alibaba.fastjson.JSONObject;\nimport com.yomahub.liteflow.script.ScriptExecuteWrap;\nimport com.yomahub.liteflow.script.body.CommonScriptBody;\nimport com.yomahub.liteflow.spi.holder.ContextAwareHolder;\nimport testnet.client.service.ILiteFlowMessageSendService;\nimport testnet.common.dto.IpOrWebOrSubDomainToVulDTO;\nimport testnet.common.entity.liteflow.TaskExecuteMessage;\nimport testnet.common.utils.CommandUtils;\nimport testnet.common.utils.FileUtils;\n\nimport java.nio.file.Files;\nimport java.nio.file.Paths;\nimport java.util.ArrayList;\nimport java.util.List;\nimport java.util.UUID;\n\n/**\n * 脚本名称：nuclei漏洞扫描\n * 适用资产：WEB、子域名、ip\n * 配置：\n * command: \'nuclei -duc -no-stdin -nc -es info,low -target %s -json-export %s\'\n * 结果处理类名: ipOrWebOrSubDomainToVulProcessor\n */\n\npublic class Nuclei implements CommonScriptBody {\n\n    public Void body(ScriptExecuteWrap wrap) {\n        TaskExecuteMessage taskExecuteMessage = wrap.cmp.getRequestData();\n        JSONObject instanceParams = JSONObject.parseObject(taskExecuteMessage.getTaskParams());\n        JSONObject config = JSONObject.parseObject(taskExecuteMessage.getConfig());\n        try {\n            ILiteFlowMessageSendService sendService = ContextAwareHolder.loadContextAware().getBean(ILiteFlowMessageSendService.class);\n            sendService.setTaskId(taskExecuteMessage.getTaskId());\n            String resultPath = taskExecuteMessage.getResultPath() + \"nuclei_\" + UUID.randomUUID() + \".json\";\n            sendService.INFO(\"结果保存路径:{}\", resultPath);\n            String command = config.getString(\"command\");\n            String asset = \"\";\n            switch (taskExecuteMessage.getAssetType()) {\n                case \"ip\":\n                    asset = instanceParams.getString(\"ip\");\n                    break;\n                case \"web\":\n                    asset = instanceParams.getString(\"webUrl\");\n                    break;\n                case \"sub_domain\":\n                    asset = instanceParams.getString(\"subDomain\");\n                    break;\n            }\n            command = String.format(command, asset, resultPath);\n            sendService.INFO(\"开始执行Nuclei漏洞扫描,命令是：{}\", command);\n            CommandUtils.CommandResult result = CommandUtils.executeCommand(command);\n            if (result.getExitCode() == 0) {\n                if (FileUtils.fileExists(resultPath)) {\n                    String content = new String(Files.readAllBytes(Paths.get(resultPath)));\n                    JSONArray jsonArray = JSON.parseArray(content);\n                    if (jsonArray != null) {\n                        sendService.INFO(\"Nuclei漏洞扫描成功，结果是：\" + content);\n                        IpOrWebOrSubDomainToVulDTO ipOrWebOrSubDomainToVulDTO = getIpOrWebOrSubDomainToVulDTO(jsonArray);\n                        sendService.sendResult(ipOrWebOrSubDomainToVulDTO);\n                    }\n                } else {\n                    sendService.INFO(\"Nuclei漏洞扫描执行成功，结果文件不存在，可能扫描结果为空！\");\n                }\n            } else {\n                sendService.ERROR(\"Nuclei漏洞扫描执行失败,状态码是:{},输出信息:{}\", result.getExitCode(), result.getOutput());\n            }\n        } catch (Exception e) {\n            throw new RuntimeException(e);\n        }\n        return null;\n    }\n\n    private IpOrWebOrSubDomainToVulDTO getIpOrWebOrSubDomainToVulDTO(JSONArray jsonArray) {\n        IpOrWebOrSubDomainToVulDTO ipOrWebOrSubDomainToVulDTO = new IpOrWebOrSubDomainToVulDTO();\n        List<IpOrWebOrSubDomainToVulDTO.AssetVul> assetVulList = new ArrayList<>();\n        for (Object o : jsonArray) {\n            JSONObject jsonObject = (JSONObject) o;\n            IpOrWebOrSubDomainToVulDTO.AssetVul assetVul = new IpOrWebOrSubDomainToVulDTO.AssetVul();\n            JSONObject info = jsonObject.getJSONObject(\"info\");\n            if (info != null) {\n                assetVul.setVulName(info.getString(\"name\"));\n                assetVul.setSeverity(info.getString(\"severity\"));\n                assetVul.setVulDesc(info.getString(\"description\"));\n            }\n            if (jsonObject.getString(\"request\") != null) {\n                assetVul.setRequestBody(jsonObject.getString(\"request\"));\n            }\n            if (jsonObject.getString(\"response\") != null) {\n                assetVul.setResponseBody(jsonObject.getString(\"response\"));\n            }\n            if (jsonObject.getString(\"curl-command\") != null) {\n                assetVul.setPayload(jsonObject.getString(\"curl-command\"));\n            }\n            if (jsonObject.getString(\"url\") != null) {\n                assetVul.setVulUrl(jsonObject.getString(\"url\"));\n            }\n            assetVulList.add(assetVul);\n        }\n        ipOrWebOrSubDomainToVulDTO.setAssetVulList(assetVulList);\n        return ipOrWebOrSubDomainToVulDTO;\n    }\n\n}', 'java', 1, 'testnet-client', 'nuclei', 'VUL', 'nuclei --version 2>&1 | grep -oP \'v\\d+\\.\\d+\\.\\d+\' | head -1', 1, '');
INSERT INTO `lite_flow_script` VALUES ('1790213876943757314', 'admin', '2024-05-01 00:00:00', 'admin', '2024-05-01 00:00:00', 'A01', 'nmap端口扫描', 'script', 'import com.alibaba.fastjson.JSONObject;\nimport com.yomahub.liteflow.script.ScriptExecuteWrap;\nimport com.yomahub.liteflow.script.body.CommonScriptBody;\nimport com.yomahub.liteflow.spi.holder.ContextAwareHolder;\nimport org.w3c.dom.Document;\nimport org.w3c.dom.Element;\nimport org.w3c.dom.Node;\nimport org.w3c.dom.NodeList;\nimport testnet.client.service.ILiteFlowMessageSendService;\nimport testnet.common.dto.IpOrSubDomainToPortDTO;\nimport testnet.common.entity.liteflow.TaskExecuteMessage;\nimport testnet.common.utils.CommandUtils;\n\nimport javax.xml.parsers.DocumentBuilder;\nimport javax.xml.parsers.DocumentBuilderFactory;\nimport java.io.File;\nimport java.nio.file.Paths;\nimport java.util.ArrayList;\nimport java.util.List;\nimport java.util.UUID;\n\n\n/**\n * 脚本名称：Nmap 端口扫描\n * 适用资产：子域名、IP\n * 配置：\n * command: \'nmap -T4 -sV -Pn %s -oX %s\'\n * 结果处理类名: ipOrSubDomainToPortProcessor\n */\npublic class Nmap implements CommonScriptBody {\n\n    public Void body(ScriptExecuteWrap wrap) {\n        // 获取的是chain初始化的参数\n        TaskExecuteMessage taskExecuteMessage = wrap.cmp.getRequestData();\n        try {\n            ILiteFlowMessageSendService messageSendService = ContextAwareHolder.loadContextAware().getBean(ILiteFlowMessageSendService.class);\n            messageSendService.setTaskId(taskExecuteMessage.getTaskId());\n            JSONObject config = JSONObject.parseObject(taskExecuteMessage.getConfig());\n            JSONObject instanceParams = JSONObject.parseObject(taskExecuteMessage.getTaskParams());\n            String resultPath = taskExecuteMessage.getResultPath() + \"nmap_\" + UUID.randomUUID() + \".xml\";\n            messageSendService.INFO(\"结果保存路径:{}\", resultPath);\n            String command = config.getString(\"command\");\n            switch (taskExecuteMessage.getAssetType()) {\n                case \"ip\":\n                    command = String.format(command, instanceParams.getString(\"ip\"), resultPath);\n                    break;\n                case \"sub_domain\":\n                    command = String.format(command, instanceParams.getString(\"subDomain\"), resultPath);\n                    break;\n                case \"port\":\n                    command = String.format(command, instanceParams.getString(\"ip_dictText\") + \" -p \" + instanceParams.getString(\"port\"), resultPath);\n                    break;\n            }\n            messageSendService.INFO(\"开始执行Nmap端口扫描,命令是:{}\", command);\n            CommandUtils.CommandResult result = CommandUtils.executeCommand(command);\n            if (result.getExitCode() == 0) {\n                messageSendService.INFO(\"Nmap端口扫描执行完成,结果是:{}\", result.getOutput());\n                IpOrSubDomainToPortDTO dto = new IpOrSubDomainToPortDTO();\n                List<IpOrSubDomainToPortDTO.Port> portList = new ArrayList<>();\n                DocumentBuilderFactory dbFactory = DocumentBuilderFactory.newInstance();\n                DocumentBuilder dBuilder = dbFactory.newDocumentBuilder();\n                File file = Paths.get(resultPath).toFile();\n                Document doc = dBuilder.parse(file);\n                doc.getDocumentElement().normalize();\n                NodeList nodeList = doc.getElementsByTagName(\"port\");\n                for (int i = 0; i < nodeList.getLength(); i++) {\n                    Node portNode = nodeList.item(i);\n                    if (portNode.getNodeType() == Node.ELEMENT_NODE) {\n                        Element portElement = (Element) portNode;\n                        // 检查端口是否为 closed 状态，若是则跳过\n                        String state = portElement.getElementsByTagName(\"state\").item(0).getAttributes().getNamedItem(\"state\").getNodeValue();\n                        if (\"closed\".equals(state) || \"filtered\".equals(state)) {\n                            continue;\n                        }\n                        IpOrSubDomainToPortDTO.Port port = new IpOrSubDomainToPortDTO.Port();\n                        // 设置端口号\n                        port.setPort(Integer.parseInt(portElement.getAttribute(\"portid\")));\n                        // 设置协议\n                        port.setProtocol(portElement.getAttribute(\"protocol\"));\n                        // 获取服务信息\n                        NodeList serviceList = portElement.getElementsByTagName(\"service\");\n                        if (serviceList.getLength() > 0) {\n                            Element serviceElement = (Element) serviceList.item(0);\n                            String product = serviceElement.getAttribute(\"product\");\n                            String version = serviceElement.getAttribute(\"version\");\n                            String service = serviceElement.getAttribute(\"name\");\n                            // 设置服务名称和版本号\n                            port.setService(service);\n                            port.setVersion(version);\n                            port.setProduct(product);\n                            if (service.equals(\"http\") || service.equals(\"https\")) {\n                                port.setIsWeb(\"Y\");\n                            } else {\n                                port.setIsWeb(\"N\");\n                            }\n                        }\n                        // 获取所属主机信息\n                        if (doc.getElementsByTagName(\"address\") != null && doc.getElementsByTagName(\"address\").getLength() > 0) {\n                            String ip = doc.getElementsByTagName(\"address\").item(0).getAttributes().getNamedItem(\"addr\").getNodeValue();\n                            // 设置IP地址和主机名\n                            port.setIp(ip);\n                        }\n                        if (doc.getElementsByTagName(\"hostname\") != null && doc.getElementsByTagName(\"hostname\").getLength() > 0) {\n                            String hostName = doc.getElementsByTagName(\"hostname\").item(0).getAttributes().getNamedItem(\"name\").getNodeValue();\n                            port.setHost(hostName);\n                        }\n                        portList.add(port);\n                    }\n                }\n                dto.setPortList(portList);\n                messageSendService.sendResult(dto);\n            } else {\n                messageSendService.ERROR(\"Nmap端口扫描执行失败,错误信息是:{}\", result.getExitCode());\n            }\n        } catch (Exception e) {\n            throw new RuntimeException(e);\n        }\n        return null;\n    }\n}', 'java', 1, 'testnet-client', 'nmap', 'PORT', 'nmap --version 2>&1 | grep -oP \'Nmap version \\K\\d+\\.\\d+\'', 1, '');
INSERT INTO `lite_flow_script` VALUES ('1795006678340747265', 'admin', '2024-05-01 00:00:00', 'admin', '2024-05-01 00:00:00', 'A01', 'subfinder子域名扫描', 'script', 'import com.alibaba.fastjson.JSONObject;\nimport com.yomahub.liteflow.script.ScriptExecuteWrap;\nimport com.yomahub.liteflow.script.body.CommonScriptBody;\nimport com.yomahub.liteflow.spi.holder.ContextAwareHolder;\nimport testnet.client.service.ILiteFlowMessageSendService;\nimport testnet.common.dto.DomainToSubdomainsAndIpsDTO;\nimport testnet.common.entity.liteflow.TaskExecuteMessage;\nimport testnet.common.utils.CommandUtils;\n\nimport java.io.BufferedReader;\nimport java.io.FileReader;\nimport java.nio.file.Paths;\nimport java.util.ArrayList;\nimport java.util.List;\nimport java.util.UUID;\n\n/**\n * 脚本名称：SubFinder子域名扫描\n * 适用资产：域名\n * 配置：\n * resultPath: \'/testnet-client/results/subfinder-%s.json\'\n * command: \'subfinder -d %s -duc -oJ -o %s\'\n * 结果处理类名: domainToSubDomainAndIPProcessor\n */\npublic class SubFinder implements CommonScriptBody {\n    public Void body(ScriptExecuteWrap wrap) {\n        TaskExecuteMessage taskExecuteMessage = wrap.cmp.getRequestData();\n        JSONObject instanceParams = JSONObject.parseObject(taskExecuteMessage.getTaskParams());\n        JSONObject config = JSONObject.parseObject(taskExecuteMessage.getConfig());\n        try {\n            ILiteFlowMessageSendService sendService = ContextAwareHolder.loadContextAware().getBean(ILiteFlowMessageSendService.class);\n            sendService.setTaskId(taskExecuteMessage.getTaskId());\n            String domain = instanceParams.getString(\"domain\");\n            String resultPath = taskExecuteMessage.getResultPath() + \"subfinder_\" + UUID.randomUUID() + \".json\";\n            sendService.INFO(\"结果保存路径:{}\", resultPath);\n            String command = config.getString(\"command\");\n            command = String.format(command, domain, resultPath);\n            sendService.INFO(\"开始执行SubFinder,命令是:{}\", command);\n            CommandUtils.CommandResult result = CommandUtils.executeCommand(command);\n            sendService.INFO(\"开始解析SubFinder结果\");\n            if (result.getExitCode() == 0) {\n                sendService.INFO(\"执行成功,输出结果: {}\", result.getOutput());\n                BufferedReader reader = new BufferedReader(new FileReader(Paths.get(resultPath).toFile()));\n                String line;\n                DomainToSubdomainsAndIpsDTO domainToSubdomainsAndIpsDTO = new DomainToSubdomainsAndIpsDTO();\n                List<DomainToSubdomainsAndIpsDTO.SudDomain> subDomainList = new ArrayList<>();\n                while ((line = reader.readLine()) != null) {\n                    // 处理每一行内容\n                    JSONObject jsonObject = JSONObject.parseObject(line);\n                    sendService.INFO(\"SubFinder子域名扫描执行结果:{}\", jsonObject);\n                    if (jsonObject != null) {\n                        DomainToSubdomainsAndIpsDTO.SudDomain sudDomain = new DomainToSubdomainsAndIpsDTO.SudDomain();\n                        sudDomain.setSubDomain(jsonObject.getString(\"host\"));\n                        sudDomain.setSource(\"SubFinder-\" + \":\" + jsonObject.getString(\"source\"));\n                        subDomainList.add(sudDomain);\n                    }\n                }\n                domainToSubdomainsAndIpsDTO.setSubDomainList(subDomainList);\n                sendService.sendResult(domainToSubdomainsAndIpsDTO);\n            } else {\n                sendService.ERROR(\"执行失败,输出结果: {}\", result.getOutput());\n            }\n        } catch (Exception e) {\n            throw new RuntimeException(e);\n        }\n        return null;\n    }\n}', 'java', 1, 'testnet-client', 'subfinder', 'SUBDOMAIN', 'subfinder -version 2>&1 | grep -oP \'v\\d+\\.\\d+\\.\\d+\' | head -1', 1, '');
INSERT INTO `lite_flow_script` VALUES ('1797542305536675842', 'admin', '2024-05-01 00:00:00', 'admin', '2024-05-01 00:00:00', 'A01', 'dns解析探测存活及CDN', 'script', 'import com.alibaba.fastjson.JSONObject;\nimport com.yomahub.liteflow.script.ScriptExecuteWrap;\nimport com.yomahub.liteflow.script.body.CommonScriptBody;\nimport com.yomahub.liteflow.spi.holder.ContextAwareHolder;\nimport org.apache.commons.lang.StringUtils;\nimport org.xbill.DNS.*;\nimport org.xbill.DNS.Record;\nimport testnet.client.service.ILiteFlowMessageSendService;\nimport testnet.common.dto.AssetUpdateDTO;\nimport testnet.common.entity.liteflow.TaskExecuteMessage;\n\nimport java.net.InetAddress;\nimport java.net.UnknownHostException;\nimport java.time.Duration;\nimport java.util.concurrent.*;\n\n/**\n * 脚本名称：dns解析\n * 通过dns解析判断域名是否有效及是否有CDN\n * 适用资产：子域名\n * 结果处理类名: assetUpdateProcessor\n */\npublic class DnsResolver implements CommonScriptBody {\n\n    private ILiteFlowMessageSendService messageSendService;\n\n    private boolean isPrivateIP(String ip) {\n        try {\n            InetAddress inetAddress = InetAddress.getByName(ip);\n            byte[] address = inetAddress.getAddress();\n\n            // Check if the IP is IPv4\n            if (address.length == 4) {\n                int firstOctet = address[0] & 0xFF;\n                int secondOctet = address[1] & 0xFF;\n\n                // 10.0.0.0 - 10.255.255.255\n                if (firstOctet == 10) {\n                    return true;\n                }\n\n                // 172.16.0.0 - 172.31.255.255\n                if (firstOctet == 172 && secondOctet >= 16 && secondOctet <= 31) {\n                    return true;\n                }\n\n                // 192.168.0.0 - 192.168.255.255\n                if (firstOctet == 192 && secondOctet == 168) {\n                    return true;\n                }\n            }\n        } catch (UnknownHostException e) {\n            e.printStackTrace();\n        }\n\n        return false;\n    }\n\n    public Void body(ScriptExecuteWrap wrap) {\n\n        TaskExecuteMessage taskExecuteMessage = (TaskExecuteMessage) wrap.cmp.getRequestData();\n        try {\n            messageSendService = (ILiteFlowMessageSendService) ContextAwareHolder.loadContextAware().getBean(ILiteFlowMessageSendService.class);\n            messageSendService.setTaskId(taskExecuteMessage.getTaskId());\n            messageSendService.INFO(\"开始dns解析探测...\");\n            JSONObject jsonObject = JSONObject.parseObject(taskExecuteMessage.getTaskParams());\n            String subDomain = jsonObject.getString(\"subDomain\");\n            Resolver resolver = new SimpleResolver(\"223.5.5.5\");\n            Duration timeoutDuration = Duration.ofSeconds(2);\n            resolver.setTimeout(timeoutDuration);\n            DNSResult result = getDNSRecords(subDomain, resolver);\n            boolean isCdn = false;\n            boolean success = false;\n            if (result.getARecords().length > 0) {\n                success = true;\n                StringBuilder ips = new StringBuilder();\n                for (String ip : result.getARecords()) {\n                    messageSendService.INFO(\"检测到域名:{} A记录：{}\", subDomain, ip);\n                    if (ips.length() > 0) {\n                        ips.append(\",\");\n                    }\n                    ips.append(ip);\n                }\n                jsonObject.put(\"ips\", ips.toString());\n                if (result.getARecords().length > 1) {\n                    isCdn = true;\n                }\n            }\n            if (result.getCname() != null) {\n                success = true;\n                isCdn = true;\n                messageSendService.INFO(\"检测到域名:{} CNAME记录：{}\", subDomain, result.getCname());\n                jsonObject.put(\"dnsRecord\", result.getCname());\n            }\n            if (isCdn) {\n                jsonObject.put(\"assetLabel\", \"cdn\");\n            }\n            if (!success) {\n                jsonObject.put(\"assetLabel\", \"无效资产\");\n            }\n            if (result.getARecords().length == 1 && isPrivateIP(result.getARecords()[0])) {\n                jsonObject.put(\"assetLabel\", \"内网IP\");\n            }\n            if (StringUtils.isNotBlank(jsonObject.getString(\"assetLabel\"))) {\n\n            }\n            messageSendService.INFO(\"dns解析完成:{}\", jsonObject.toString());\n            AssetUpdateDTO assetUpdateDTO = new AssetUpdateDTO();\n            assetUpdateDTO.setData(jsonObject.toString());\n            messageSendService.sendResult(assetUpdateDTO);\n        } catch (Exception e) {\n            throw new RuntimeException(e);\n        }\n        return null;\n    }\n\n    public DNSResult getDNSRecords(final String domain, final Resolver resolver) throws InterruptedException, ExecutionException {\n        ExecutorService executor = Executors.newFixedThreadPool(2);\n\n        Callable<String> cnameTask = new Callable<String>() {\n            @Override\n            public String call() throws Exception {\n                return getCNAMERecord(domain, resolver);\n            }\n        };\n\n        Callable<String[]> aTask = new Callable<String[]>() {\n            @Override\n            public String[] call() throws Exception {\n                return getARecords(domain, resolver);\n            }\n        };\n\n        Future<String> cnameFuture = executor.submit(cnameTask);\n        Future<String[]> aFuture = executor.submit(aTask);\n\n        String cname = (String) cnameFuture.get();\n        String[] aRecords = (String[]) aFuture.get();\n\n        executor.shutdown();\n\n        return new DNSResult(cname, aRecords);\n    }\n\n    public String getCNAMERecord(String domain, Resolver resolver) throws Exception {\n        Lookup lookup = new Lookup(domain, Type.CNAME);\n        lookup.setResolver(resolver);\n        lookup.run();\n        if (lookup.getResult() == Lookup.SUCCESSFUL) {\n            Record[] records = lookup.getAnswers();\n            return records.length > 0 ? records[0].rdataToString() : null;\n        }\n        return null;\n    }\n\n    public String[] getARecords(String domain, Resolver resolver) throws Exception {\n        Lookup lookup = new Lookup(domain, Type.A);\n        lookup.setResolver(resolver);\n        lookup.run();\n        if (lookup.getResult() == Lookup.SUCCESSFUL) {\n            Record[] records = lookup.getAnswers();\n            String[] ips = new String[records.length];\n            for (int i = 0; i < records.length; i++) {\n                ips[i] = records[i].rdataToString();\n            }\n            return ips;\n        }\n        return new String[0];\n    }\n\n    private class DNSResult {\n        private final String cname;\n        private final String[] aRecords;\n\n        public DNSResult(String cname, String[] aRecords) {\n            this.cname = cname;\n            this.aRecords = aRecords;\n        }\n\n        public String getCname() {\n            return cname;\n        }\n\n        public String[] getARecords() {\n            return aRecords;\n        }\n    }\n}', 'java', 1, 'testnet-client', 'dns', 'PING', NULL, 0, NULL);
INSERT INTO `lite_flow_script` VALUES ('1801110432837046273', 'admin', '2024-05-01 00:00:00', 'admin', '2024-05-01 00:00:00', 'A01', 'dirsearch敏感目录探测', 'script', 'import com.alibaba.fastjson.JSON;\nimport com.alibaba.fastjson.JSONArray;\nimport com.alibaba.fastjson.JSONObject;\nimport com.yomahub.liteflow.script.ScriptExecuteWrap;\nimport com.yomahub.liteflow.script.body.CommonScriptBody;\nimport com.yomahub.liteflow.spi.holder.ContextAwareHolder;\nimport testnet.client.service.ILiteFlowMessageSendService;\nimport testnet.common.dto.AssetApiToApiDTO;\nimport testnet.common.entity.liteflow.TaskExecuteMessage;\nimport testnet.common.utils.CommandUtils;\nimport testnet.common.utils.FileUtils;\n\nimport java.nio.file.Files;\nimport java.nio.file.Paths;\nimport java.util.ArrayList;\nimport java.util.List;\nimport java.util.UUID;\n\n\n/**\n * 脚本名称：DirSearch敏感目录扫描\n * 适用资产：API\n * command: \'python3 /testnet-client/dirsearch/dirsearch.py -u %s -q -t 30 --format=json -o %s\'\n * 结果处理类名: ApiToApiProcessor\n */\n\n\npublic class DirSearch implements CommonScriptBody {\n    public Void body(ScriptExecuteWrap wrap) {\n        TaskExecuteMessage taskExecuteMessage = wrap.cmp.getRequestData();\n        try {\n            ILiteFlowMessageSendService sendService = ContextAwareHolder.loadContextAware().getBean(ILiteFlowMessageSendService.class);\n            sendService.setTaskId(taskExecuteMessage.getTaskId());\n            JSONObject config = JSONObject.parseObject(taskExecuteMessage.getConfig());\n            String command = config.getString(\"command\");\n            String resultPath = taskExecuteMessage.getResultPath() + \"dir_search_\" + UUID.randomUUID() + \".json\";\n            sendService.INFO(\"结果保存路径:{}\", resultPath);\n            JSONObject jsonObject = JSONObject.parseObject(taskExecuteMessage.getTaskParams());\n            String webUrl = jsonObject.getString(\"absolutePath\");\n            command = String.format(command, webUrl, resultPath);\n            sendService.INFO(\"开始执行DirSearch敏感目录扫描,命令是:{}\", command);\n            CommandUtils.CommandResult result = CommandUtils.executeCommand(command);\n            if (result.getExitCode() == 0) {\n                if (FileUtils.fileExists(resultPath)) {\n                    String content = new String(Files.readAllBytes(Paths.get(resultPath)));\n                    JSONObject resultJson = JSON.parseObject(content);\n                    if (resultJson != null) {\n                        sendService.INFO(\"DirSearch敏感目录扫描成功，结果是：{}\", content);\n                    }\n                    JSONArray results = null;\n                    if (resultJson != null) {\n                        results = resultJson.getJSONArray(\"results\");\n                        AssetApiToApiDTO assetApiToApiDTO = new AssetApiToApiDTO();\n                        if (results != null && !results.isEmpty()) {\n                            List<AssetApiToApiDTO.AssetApiDTO> assetApiDTOList = new ArrayList<>();\n                            for (int i = 0; i < results.size(); i++) {\n                                JSONObject resultItem = results.getJSONObject(i);\n                                AssetApiToApiDTO.AssetApiDTO assetApiDTO = new AssetApiToApiDTO.AssetApiDTO();\n                                assetApiDTO.setAbsolutePath(resultItem.getString(\"url\"));\n                                assetApiDTO.setStatusCode(resultItem.getInteger(\"status\"));\n                                assetApiDTO.setContentLength(resultItem.getInteger(\"content-length\"));\n                                assetApiDTO.setContentType(resultItem.getString(\"content-type\"));\n                                assetApiDTO.setHttpMethod(\"GET\");\n                                assetApiDTOList.add(assetApiDTO);\n                            }\n                            assetApiToApiDTO.setAssetApiDTOList(assetApiDTOList);\n                            sendService.sendResult(assetApiToApiDTO);\n                        }\n                    } else {\n                        sendService.INFO(\"DirSearch敏感目录扫描执行成功，结果文件为空\");\n                    }\n                } else {\n                    sendService.INFO(\"DirSearch敏感目录扫描执行成功，结果文件不存在，可能扫描结果为空！\");\n                }\n            } else {\n                sendService.ERROR(\"DirSearch敏感目录扫描执行失败,状态码是:{},输出信息:{}\", result.getExitCode(), result.getOutput());\n            }\n\n        } catch (Exception e) {\n            throw new RuntimeException(e);\n        }\n        return null;\n    }\n}', 'java', 1, 'testnet-client', 'dirsearch', 'CRAWLER', 'python3 /testnet-client/default_tools/dirsearch/dirsearch.py --version 2>&1 | grep -oP \'v?\\d+\\.\\d+\\.\\d+\'', 1, '');
INSERT INTO `lite_flow_script` VALUES ('1806588765662212097', 'admin', '2024-05-01 00:00:00', 'admin', '2024-05-01 00:00:00', 'A01', 'TideFinger_Go Web指纹识别', 'script', 'import com.alibaba.fastjson.JSONArray;\nimport com.alibaba.fastjson.JSONObject;\nimport com.yomahub.liteflow.script.ScriptExecuteWrap;\nimport com.yomahub.liteflow.script.body.CommonScriptBody;\nimport com.yomahub.liteflow.spi.holder.ContextAwareHolder;\nimport org.apache.commons.lang.StringUtils;\nimport testnet.client.service.ILiteFlowMessageSendService;\nimport testnet.common.dto.AssetUpdateDTO;\nimport testnet.common.entity.liteflow.TaskExecuteMessage;\nimport testnet.common.utils.CommandUtils;\n\nimport java.util.regex.Matcher;\nimport java.util.regex.Pattern;\n\n/**\n * 脚本名称：TideFinger_Go指纹探测\n * 适用资产：WEB\n * 配置：\n * command: \'/testnet-client/TideFinger -u %s -np -nobr -nopoc\'\n * 结果处理类名: assetUpdateProcessor\n */\n\npublic class TideFinger_Go implements CommonScriptBody {\n\n    public Void body(ScriptExecuteWrap wrap) {\n        TaskExecuteMessage taskExecuteMessage = wrap.cmp.getRequestData();\n        JSONObject instanceParams = JSONObject.parseObject(taskExecuteMessage.getTaskParams());\n        JSONObject config = JSONObject.parseObject(taskExecuteMessage.getConfig());\n        try {\n            ILiteFlowMessageSendService sendService = ContextAwareHolder.loadContextAware().getBean(ILiteFlowMessageSendService.class);\n            sendService.setTaskId(taskExecuteMessage.getTaskId());\n            String command = config.getString(\"command\");\n            String asset = instanceParams.getString(\"webUrl\");\n            command = String.format(command, asset);\n            sendService.INFO(\"开始执行TideFinger,命令是：{}\", command);\n            CommandUtils.CommandResult result = CommandUtils.executeCommand(command);\n            if (result.getExitCode() == 0) {\n                sendService.INFO(\"TideFinger执行成功，结果是:{}\", result.getOutput());\n                Pattern pattern = Pattern.compile(\"\\\\[\\\\d{2}:\\\\d{2}:\\\\d{2}] \\\\[\\\\+] \\\\[(TCP/HTTP|TLS/HTTPS)] \\\\[(\\\\d{3})] ((\\\\[.*?])+?) .*? \\\\[(.*?)]\");\n                Matcher matcher = pattern.matcher(result.getOutput());\n                while (matcher.find()) {\n                    String statusCode = matcher.group(2);\n                    String fingerprint = matcher.group(3);\n                    String title = matcher.group(5);\n                    sendService.INFO(\"提取到的指纹是:{}\", fingerprint);\n                    sendService.INFO(\"提取到的标题是:{}\", title);\n                    sendService.INFO(\"提取到的状态码是:{}\", statusCode);\n                    JSONObject jsonObject = new JSONObject();\n                    jsonObject.put(\"portId\", instanceParams.getString(\"portId\"));\n                    jsonObject.put(\"domain\", instanceParams.getString(\"domain\"));\n                    jsonObject.put(\"projectId\", instanceParams.getString(\"projectId\"));\n                    if (StringUtils.isNotBlank(fingerprint)) {\n                        JSONArray versions = new JSONArray();\n                        String[] parts = fingerprint.split(\"]\\\\[\"); // 用特定的分隔符来拆分字符串\n                        for (String part : parts) {\n                            part = part.replace(\"[\", \"\").replace(\"]\", \"\");\n                            if (!part.trim().isEmpty()) {\n                                // 进一步拆分每个部分以获取名称和版本\n                                String[] nameAndVersion = part.split(\" \");\n                                JSONObject softwareInfo = new JSONObject();\n                                softwareInfo.put(\"name\", nameAndVersion[0]); // 软件名称\n                                if (nameAndVersion.length > 1) {\n                                    softwareInfo.put(\"version\", nameAndVersion[1]); // 软件版本\n                                }\n                                versions.add(softwareInfo);\n                            }\n                        }\n                        jsonObject.put(\"tech\", versions);\n                    }\n                    jsonObject.put(\"title\", title);\n                    jsonObject.put(\"statusCode\", statusCode);\n\n                    AssetUpdateDTO assetUpdateDTO = new AssetUpdateDTO();\n                    assetUpdateDTO.setData(jsonObject.toJSONString());\n                    sendService.sendResult(assetUpdateDTO);\n                }\n            } else {\n                sendService.ERROR(\"TideFinger执行失败,状态码是:{},输出信息:{}\", result.getExitCode(), result.getOutput());\n            }\n        } catch (Exception e) {\n            throw new RuntimeException(e);\n        }\n        return null;\n    }\n}', 'java', 1, 'testnet-client', 'TideFinger_Go', 'CRAWLER', 'TideFinger 2>&1 | grep -oP \'version: \\K\\S+\' | head -1', 1, '');
INSERT INTO `lite_flow_script` VALUES ('1806614988580831233', 'admin', '2024-05-01 00:00:00', 'admin', '2024-05-01 00:00:00', 'A01', 'xapp指纹识别', 'script', 'import com.alibaba.fastjson.JSON;\nimport com.alibaba.fastjson.JSONArray;\nimport com.alibaba.fastjson.JSONObject;\nimport com.yomahub.liteflow.script.ScriptExecuteWrap;\nimport com.yomahub.liteflow.script.body.CommonScriptBody;\nimport com.yomahub.liteflow.spi.holder.ContextAwareHolder;\nimport testnet.client.service.ILiteFlowMessageSendService;\nimport testnet.common.dto.AssetUpdateDTO;\nimport testnet.common.entity.liteflow.TaskExecuteMessage;\nimport testnet.common.utils.CommandUtils;\nimport testnet.common.utils.FileUtils;\nimport testnet.common.utils.ObjectBase64Decoder;\n\nimport java.nio.file.Files;\nimport java.nio.file.Paths;\nimport java.util.UUID;\n\n/**\n * 脚本名称：Xapp指纹探测\n * 适用资产：WEB\n * 配置：\n * command: \'/testnet-client/xapp -t %s -o %s --silent\'\n * 结果处理类名: assetUpdateProcessor\n */\n\npublic class Xapp implements CommonScriptBody {\n\n    public Void body(ScriptExecuteWrap wrap) {\n        TaskExecuteMessage taskExecuteMessage = wrap.cmp.getRequestData();\n        JSONObject instanceParams = JSONObject.parseObject(taskExecuteMessage.getTaskParams());\n        JSONObject config = JSONObject.parseObject(taskExecuteMessage.getConfig());\n        try {\n            ILiteFlowMessageSendService sendService = ContextAwareHolder.loadContextAware().getBean(ILiteFlowMessageSendService.class);\n            sendService.setTaskId(taskExecuteMessage.getTaskId());\n            String command = config.getString(\"command\");\n            String asset = instanceParams.getString(\"webUrl\");\n            String resultPath = taskExecuteMessage.getResultPath() + \"xapp_\" + UUID.randomUUID() + \".json\";\n            sendService.INFO(\"结果保存路径:{}\", resultPath);\n            command = String.format(command, asset, resultPath);\n            sendService.INFO(\"开始执行Xapp指纹探测,命令是：{}\", command);\n            // 超时60秒\n            CommandUtils.CommandResult result = CommandUtils.executeCommand(command, 60);\n            if (result.getExitCode() == 0) {\n                if (FileUtils.fileExists(resultPath)) {\n                    String content = new String(Files.readAllBytes(Paths.get(resultPath)));\n                    JSONArray jsonArray = JSON.parseArray(content);\n                    if (jsonArray != null) {\n                        JSONObject jsonObject = new JSONObject();\n                        JSONObject value = jsonArray.getJSONObject(0).getJSONObject(\"value\");\n                        if (value.containsKey(\"title\")) {\n                            String title = value.getString(\"title\");\n                            jsonObject.put(\"webTitle\", title);\n                            sendService.INFO(\"提取到的标题是:{}\", title);\n                        }\n                        JSONArray fingerprints = value.getJSONArray(\"fingerprints\");\n                        JSONObject httpFlow = value.getJSONObject(\"httpFlow\");\n                        if (httpFlow != null) {\n                            JSONArray exchanges = httpFlow.getJSONArray(\"exchanges\");\n                            if (exchanges != null && !exchanges.isEmpty()) {\n                                String requestHeader = exchanges.getJSONObject(0).getJSONObject(\"request\").getString(\"rawHeader\");\n                                jsonObject.put(\"requestHeader\", ObjectBase64Decoder.decodeString(requestHeader));\n                                String statusCode = exchanges.getJSONObject(0).getJSONObject(\"response\").getString(\"status\");\n                                jsonObject.put(\"statusCode\", statusCode.trim());\n                                String responseHeader = exchanges.getJSONObject(0).getJSONObject(\"response\").getString(\"rawHeader\");\n                                jsonObject.put(\"responseHeader\", ObjectBase64Decoder.decodeString(responseHeader));\n                            }\n                        }\n                        JSONArray tech = new JSONArray();\n                        if (fingerprints != null) {\n                            for (int i = 0; i < fingerprints.size(); i++) {\n                                JSONObject fingerprint = fingerprints.getJSONObject(i);\n                                String fingerprintName = fingerprint.getJSONObject(\"product\").getString(\"name\");\n                                sendService.INFO(\"Xapp指纹探测执行成功，获取到的指纹是：{}\", fingerprintName);\n                                JSONObject tmp = new JSONObject();\n                                tmp.put(\"name\", fingerprintName);\n                                tech.add(tmp);\n                            }\n                        }\n\n                        jsonObject.put(\"portId\", instanceParams.getString(\"portId\"));\n                        jsonObject.put(\"domain\", instanceParams.getString(\"domain\"));\n                        jsonObject.put(\"projectId\", instanceParams.getString(\"projectId\"));\n                        jsonObject.put(\"tech\", tech);\n                        AssetUpdateDTO assetUpdateDTO = new AssetUpdateDTO();\n                        assetUpdateDTO.setData(jsonObject.toJSONString());\n                        sendService.sendResult(assetUpdateDTO);\n                    }\n                } else {\n                    sendService.INFO(\"Xapp指纹探测执行成功，结果文件不存在，可能扫描结果为空！\");\n                }\n            } else {\n                sendService.ERROR(\"Xapp指纹探测执行失败,状态码是:{},输出信息:{}\", result.getExitCode(), result.getOutput());\n            }\n        } catch (Exception e) {\n            throw new RuntimeException(e);\n        }\n        return null;\n    }\n}', 'java', 1, 'testnet-client', 'xapp', 'OTHERS', 'xapp 2>&1| grep -oP \'v\\d+\\.\\d+\\.\\d+\'', 1, '');
INSERT INTO `lite_flow_script` VALUES ('1806627700673200129', 'admin', '2024-05-01 00:00:00', 'admin', '2024-05-01 00:00:00', 'A01', 'masscan端口扫描', 'script', 'import com.alibaba.fastjson.JSONArray;\nimport com.alibaba.fastjson.JSONObject;\nimport com.yomahub.liteflow.script.ScriptExecuteWrap;\nimport com.yomahub.liteflow.script.body.CommonScriptBody;\nimport com.yomahub.liteflow.spi.holder.ContextAwareHolder;\nimport testnet.client.service.ILiteFlowMessageSendService;\nimport testnet.common.dto.IpOrSubDomainToPortDTO;\nimport testnet.common.entity.liteflow.TaskExecuteMessage;\nimport testnet.common.utils.CommandUtils;\nimport testnet.common.utils.FileUtils;\n\nimport java.nio.file.Files;\nimport java.nio.file.Paths;\nimport java.util.ArrayList;\nimport java.util.List;\nimport java.util.UUID;\n\n/**\n * 脚本名称：Masscan 端口扫描\n * 适用资产：子域名、IP\n * 配置：\n * command: \'masscan -p1-65535 %s -oJ %s\'\n * 结果处理类名: ipOrSubDomainToPortProcessor\n */\npublic class Masscan implements CommonScriptBody {\n\n    public Void body(ScriptExecuteWrap wrap) {\n        // 获取的是chain初始化的参数\n        TaskExecuteMessage taskExecuteMessage = wrap.cmp.getRequestData();\n        try {\n            ILiteFlowMessageSendService messageSendService = ContextAwareHolder.loadContextAware().getBean(ILiteFlowMessageSendService.class);\n            messageSendService.setTaskId(taskExecuteMessage.getTaskId());\n            JSONObject config = JSONObject.parseObject(taskExecuteMessage.getConfig());\n            JSONObject instanceParams = JSONObject.parseObject(taskExecuteMessage.getTaskParams());\n\n            String command = config.getString(\"command\");\n            List<String> assetList = new ArrayList<>();\n            switch (taskExecuteMessage.getAssetType()) {\n                case \"ip\":\n                    assetList.add(instanceParams.getString(\"ip\"));\n                    break;\n                case \"sub_domain\":\n                    JSONArray ipList = instanceParams.getJSONArray(\"ipList\");\n                    for (int i = 0; i < ipList.size(); i++) {\n                        String ip = ipList.getJSONObject(i).getString(\"ip\");\n                        assetList.add(ip);\n                    }\n                    break;\n            }\n            for (int k = 0; k < assetList.size(); k++) {\n                String asset = (String) assetList.get(k);\n                String resultPath = taskExecuteMessage.getResultPath() + \"masscan_\" + UUID.randomUUID() + \".json\";\n                messageSendService.INFO(\"结果保存路径:{}\", resultPath);\n                command = String.format(command, asset, resultPath);\n                messageSendService.INFO(\"开始执行Masscan端口扫描,命令是:{}\", command);\n                CommandUtils.CommandResult result = CommandUtils.executeCommand(command);\n                if (result.getExitCode() == 0) {\n                    if (FileUtils.fileExists(resultPath)) {\n                        String content = new String(Files.readAllBytes(Paths.get(resultPath)));\n                        JSONArray jsonArray = JSONArray.parseArray(content);\n                        if (jsonArray != null && !jsonArray.isEmpty()) {\n                            IpOrSubDomainToPortDTO dto = new IpOrSubDomainToPortDTO();\n                            List<IpOrSubDomainToPortDTO.Port> portList = new ArrayList<>();\n                            for (int i = 0; i < jsonArray.size(); i++) {\n                                JSONObject jsonObject = jsonArray.getJSONObject(i);\n                                JSONArray ports = jsonObject.getJSONArray(\"ports\");\n                                for (int j = 0; j < ports.size(); j++) {\n                                    JSONObject portObject = ports.getJSONObject(j);\n                                    IpOrSubDomainToPortDTO.Port port = new IpOrSubDomainToPortDTO.Port();\n                                    port.setPort(portObject.getInteger(\"port\"));\n                                    port.setProtocol(portObject.getString(\"proto\"));\n                                    port.setIp(jsonObject.getString(\"ip\"));\n                                    portList.add(port);\n                                }\n                            }\n                            dto.setPortList(portList);\n                            messageSendService.sendResult(dto);\n                        } else {\n                            messageSendService.INFO(\"资产: {} 端口扫描完成，结果为空\", asset);\n                        }\n                    } else {\n                        messageSendService.INFO(\"资产: {} 端口扫描完成，结果文件不存在\", asset);\n                    }\n                } else if (result.getExitCode() == 1) {\n                    messageSendService.INFO(\"资产: {} 端口扫描完成，没有端口开放\", asset);\n                } else {\n                    messageSendService.ERROR(\"Masscan端口扫描执行失败,错误信息是:{}\", result.getExitCode());\n                }\n            }\n\n        } catch (Exception e) {\n            throw new RuntimeException(e);\n        }\n        return null;\n    }\n}', 'java', 1, 'testnet-client', 'masscan', 'PORT', 'masscan --version 2>&1| grep \"Masscan version\" | awk \'{print $3}\' || echo \"\"', 1, '');
INSERT INTO `lite_flow_script` VALUES ('1806641579239260162', 'admin', '2024-05-01 00:00:00', 'admin', '2024-05-01 00:00:00', 'A01', 'ffuf目录扫描', 'script', 'import com.alibaba.fastjson.JSON;\nimport com.alibaba.fastjson.JSONArray;\nimport com.alibaba.fastjson.JSONObject;\nimport com.yomahub.liteflow.script.ScriptExecuteWrap;\nimport com.yomahub.liteflow.script.body.CommonScriptBody;\nimport com.yomahub.liteflow.spi.holder.ContextAwareHolder;\nimport testnet.client.service.ILiteFlowMessageSendService;\nimport testnet.common.dto.AssetApiToApiDTO;\nimport testnet.common.entity.liteflow.TaskExecuteMessage;\nimport testnet.common.utils.CommandUtils;\nimport testnet.common.utils.FileUtils;\n\nimport java.nio.file.Files;\nimport java.nio.file.Paths;\nimport java.util.ArrayList;\nimport java.util.List;\nimport java.util.UUID;\n\n/**\n * 脚本名称：FFUF敏感目录扫描\n * 适用资产：API\n * command: \'ffuf -u %s/FUZZ -w /path/to/wordlist -mc all -of json -o %s\'\n * 结果处理类名: ApiToApiProcessor\n */\n\npublic class Ffuf implements CommonScriptBody {\n    public Void body(ScriptExecuteWrap wrap) {\n        TaskExecuteMessage taskExecuteMessage = wrap.cmp.getRequestData();\n        try {\n            ILiteFlowMessageSendService sendService = ContextAwareHolder.loadContextAware().getBean(ILiteFlowMessageSendService.class);\n            sendService.setTaskId(taskExecuteMessage.getTaskId());\n            JSONObject config = JSONObject.parseObject(taskExecuteMessage.getConfig());\n            String command = config.getString(\"command\");\n            String resultPath = taskExecuteMessage.getResultPath() + \"ffuf_search_\" + UUID.randomUUID() + \".json\";\n            sendService.INFO(\"结果保存路径:{}\", resultPath);\n            JSONObject jsonObject = JSONObject.parseObject(taskExecuteMessage.getTaskParams());\n            String webUrl = jsonObject.containsKey(\"absolutePath\") ? jsonObject.getString(\"absolutePath\") : jsonObject.getString(\"webUrl\");\n            command = String.format(command, webUrl, resultPath);\n            sendService.INFO(\"开始执行FFUF敏感目录扫描,命令是:{}\", command);\n            CommandUtils.CommandResult result = CommandUtils.executeCommand(command);\n            if (result.getExitCode() == 0) {\n                if (FileUtils.fileExists(resultPath)) {\n                    String content = new String(Files.readAllBytes(Paths.get(resultPath)));\n                    JSONObject resultJson = JSON.parseObject(content);\n                    if (resultJson != null) {\n                        sendService.INFO(\"FFUF敏感目录扫描成功，结果是：{}\", content);\n                        JSONArray results = resultJson.getJSONArray(\"results\");\n                        AssetApiToApiDTO assetApiToApiDTO = new AssetApiToApiDTO();\n                        if (results != null && !results.isEmpty()) {\n                            List<AssetApiToApiDTO.AssetApiDTO> assetApiDTOList = new ArrayList<>();\n                            for (int i = 0; i < results.size(); i++) {\n                                JSONObject resultItem = results.getJSONObject(i);\n                                AssetApiToApiDTO.AssetApiDTO assetApiDTO = new AssetApiToApiDTO.AssetApiDTO();\n                                assetApiDTO.setAbsolutePath(resultItem.getString(\"url\"));\n                                assetApiDTO.setStatusCode(resultItem.getInteger(\"status\"));\n                                assetApiDTO.setContentLength(resultItem.getInteger(\"length\"));\n                                assetApiDTO.setContentType(resultItem.getString(\"content-type\"));\n                                assetApiDTO.setHttpMethod(\"GET\");\n                                assetApiDTOList.add(assetApiDTO);\n                            }\n                            assetApiToApiDTO.setAssetApiDTOList(assetApiDTOList);\n                            sendService.sendResult(assetApiToApiDTO);\n                        } else {\n                            sendService.INFO(\"FFUF敏感目录扫描执行成功，结果文件为空\");\n                        }\n                    }\n                } else {\n                    sendService.INFO(\"FFUF敏感目录扫描执行成功，结果文件不存在，可能扫描结果为空！\");\n                }\n            } else {\n                sendService.ERROR(\"FFUF敏感目录扫描执行失败,状态码是:{},输出信息:{}\", result.getExitCode(), result.getOutput());\n            }\n        } catch (Exception e) {\n            throw new RuntimeException(e);\n        }\n        return null;\n    }\n}', 'java', 1, 'testnet-client', 'ffuf', 'CRAWLER', 'ffuf -V 2>&1| grep \"version\" | cut -d \' \' -f 3 || echo \"\"', 1, '');
INSERT INTO `lite_flow_script` VALUES ('1808796498016620546', 'admin', '2024-05-01 00:00:00', 'admin', '2024-05-01 00:00:00', 'A01', 'Katana爬虫', 'script', 'import com.alibaba.fastjson.JSONObject;\nimport com.yomahub.liteflow.script.ScriptExecuteWrap;\nimport com.yomahub.liteflow.script.body.CommonScriptBody;\nimport com.yomahub.liteflow.spi.holder.ContextAwareHolder;\nimport testnet.client.service.ILiteFlowMessageSendService;\nimport testnet.common.dto.AssetApiToApiDTO;\nimport testnet.common.entity.liteflow.TaskExecuteMessage;\nimport testnet.common.utils.CommandUtils;\nimport testnet.common.utils.FileUtils;\n\nimport java.io.BufferedReader;\nimport java.io.FileReader;\nimport java.nio.file.Paths;\nimport java.util.ArrayList;\nimport java.util.List;\nimport java.util.UUID;\n\n/**\n * 脚本名称：Katana爬虫扫描扫描\n * 适用资产：API\n * command: \'katana -u %s -o %s -j -duc -or -ob -silent -jc\'\n * 结果处理类名: ApiToApiProcessor\n */\n\npublic class Katana implements CommonScriptBody {\n    public Void body(ScriptExecuteWrap wrap) {\n        TaskExecuteMessage taskExecuteMessage = wrap.cmp.getRequestData();\n        try {\n            ILiteFlowMessageSendService sendService = ContextAwareHolder.loadContextAware().getBean(ILiteFlowMessageSendService.class);\n            sendService.setTaskId(taskExecuteMessage.getTaskId());\n            JSONObject config = JSONObject.parseObject(taskExecuteMessage.getConfig());\n            String command = config.getString(\"command\");\n            String resultPath = taskExecuteMessage.getResultPath() + \"katana_\" + UUID.randomUUID() + \".json\";\n            sendService.INFO(\"结果保存路径:{}\", resultPath);\n            JSONObject jsonObject = JSONObject.parseObject(taskExecuteMessage.getTaskParams());\n            String webUrl = jsonObject.getString(\"absolutePath\");\n            command = String.format(command, webUrl, resultPath);\n            sendService.INFO(\"开始执行Katana工具扫描,命令是:{}\", command);\n            CommandUtils.CommandResult result = CommandUtils.executeCommand(command);\n            if (result.getExitCode() == 0) {\n                if (FileUtils.fileExists(resultPath)) {\n                    BufferedReader reader = new BufferedReader(new FileReader(Paths.get(resultPath).toFile()));\n                    String line;\n                    List<AssetApiToApiDTO.AssetApiDTO> assetApiDTOList = new ArrayList<>();\n                    while ((line = reader.readLine()) != null) {\n                        // 处理每一行内容\n                        JSONObject jsonResult = JSONObject.parseObject(line);\n                        sendService.INFO(\"Katana扫描执行结果:{}\", jsonResult);\n                        if (jsonResult != null) {\n                            JSONObject request = jsonResult.getJSONObject(\"request\");\n                            if (request != null) {\n                                AssetApiToApiDTO.AssetApiDTO assetApiDTO = new AssetApiToApiDTO.AssetApiDTO();\n                                assetApiDTO.setHttpMethod(request.getString(\"method\"));\n                                assetApiDTO.setAbsolutePath(request.getString(\"endpoint\"));\n                                JSONObject response = jsonResult.getJSONObject(\"response\");\n                                if (response != null) {\n                                    assetApiDTO.setStatusCode(response.getInteger(\"status_code\"));\n                                    JSONObject headers = response.getJSONObject(\"headers\");\n                                    if (headers != null) {\n                                        if (headers.containsKey(\"content_type\")) {\n                                            assetApiDTO.setContentType(headers.getString(\"content_type\"));\n                                        }\n                                        if (headers.containsKey(\"content_length\")) {\n                                            assetApiDTO.setContentLength(Integer.valueOf(headers.getString(\"content_length\")));\n                                        }\n                                    }\n                                }\n                                assetApiDTOList.add(assetApiDTO);\n                            }\n                        }\n                    }\n                    AssetApiToApiDTO assetApiToApiDTO = new AssetApiToApiDTO();\n                    assetApiToApiDTO.setAssetApiDTOList(assetApiDTOList);\n                    sendService.sendResult(assetApiToApiDTO);\n                } else {\n                    sendService.INFO(\"Katana工具扫描执行成功，结果文件为空\");\n                }\n            } else {\n                sendService.ERROR(\"Katana工具扫描执行失败,状态码是:{},输出信息:{}\", result.getExitCode(), result.getOutput());\n            }\n        } catch (Exception e) {\n            throw new RuntimeException(e);\n        }\n        return null;\n    }\n}', 'java', 1, 'testnet-client', 'katana', 'CRAWLER', 'katana -version 2>&1  | grep -oP \'v\\d+\\.\\d+\\.\\d+\' | head -1', 1, '');
INSERT INTO `lite_flow_script` VALUES ('1810994896139808770', 'admin', '2024-05-01 00:00:00', 'admin', '2024-05-01 00:00:00', 'A01', 'xpoc漏洞扫描', 'script', 'import com.alibaba.fastjson.JSON;\nimport com.alibaba.fastjson.JSONArray;\nimport com.alibaba.fastjson.JSONObject;\nimport com.yomahub.liteflow.script.ScriptExecuteWrap;\nimport com.yomahub.liteflow.script.body.CommonScriptBody;\nimport com.yomahub.liteflow.spi.holder.ContextAwareHolder;\nimport testnet.client.service.ILiteFlowMessageSendService;\nimport testnet.common.dto.IpOrWebOrSubDomainToVulDTO;\nimport testnet.common.entity.liteflow.TaskExecuteMessage;\nimport testnet.common.utils.CommandUtils;\nimport testnet.common.utils.FileUtils;\n\nimport java.nio.file.Files;\nimport java.nio.file.Paths;\nimport java.util.ArrayList;\nimport java.util.List;\nimport java.util.UUID;\n\n/**\n * 脚本名称：nuclei漏洞扫描\n * 适用资产：WEB、子域名、ip\n * 配置：\n * command: \'/testnet-client/xpoc -t %s -o %s\'\n * 结果处理类名: ipOrWebOrSubDomainToVulProcessor\n */\n\npublic class Xpoc implements CommonScriptBody {\n\n    public Void body(ScriptExecuteWrap wrap) {\n        TaskExecuteMessage taskExecuteMessage = wrap.cmp.getRequestData();\n        JSONObject instanceParams = JSONObject.parseObject(taskExecuteMessage.getTaskParams());\n        JSONObject config = JSONObject.parseObject(taskExecuteMessage.getConfig());\n        try {\n            ILiteFlowMessageSendService sendService = ContextAwareHolder.loadContextAware().getBean(ILiteFlowMessageSendService.class);\n            sendService.setTaskId(taskExecuteMessage.getTaskId());\n            String resultPath = taskExecuteMessage.getResultPath() + \"xpoc_\" + UUID.randomUUID() + \".json\";\n            sendService.INFO(\"结果保存路径:{}\", resultPath);\n            String command = config.getString(\"command\");\n            String asset = \"\";\n            switch (taskExecuteMessage.getAssetType()) {\n                case \"ip\":\n                    asset = instanceParams.getString(\"ip\");\n                    break;\n                case \"web\":\n                    asset = instanceParams.getString(\"webUrl\");\n                    break;\n                case \"sub_domain\":\n                    asset = instanceParams.getString(\"subDomain\");\n                    break;\n            }\n            command = String.format(command, asset, resultPath);\n            sendService.INFO(\"开始执行Xpoc漏洞扫描,命令是：{}\", command);\n            CommandUtils.CommandResult result = CommandUtils.executeCommand(command);\n            if (result.getExitCode() == 0) {\n                if (FileUtils.fileExists(resultPath)) {\n                    String content = new String(Files.readAllBytes(Paths.get(resultPath)));\n                    JSONArray jsonArray = JSON.parseArray(content);\n                    if (jsonArray != null) {\n                        IpOrWebOrSubDomainToVulDTO ipOrWebOrSubDomainToVulDTO = new IpOrWebOrSubDomainToVulDTO();\n                        List<IpOrWebOrSubDomainToVulDTO.AssetVul> assetVulList = new ArrayList<>();\n                        for (Object o : jsonArray) {\n                            JSONObject json = (JSONObject) o;\n                            if (json.getString(\"type\") != null && json.getString(\"type\").equals(\"*event.Vulnerability\")) {\n                                sendService.INFO(\"Xpoc漏洞扫描发现漏洞，结果是：\" + json);\n                                IpOrWebOrSubDomainToVulDTO.AssetVul assetVul = new IpOrWebOrSubDomainToVulDTO.AssetVul();\n                                assetVul.setVulName(json.getJSONObject(\"value\").getString(\"name\"));\n                                assetVul.setVulDesc(json.getJSONObject(\"value\").getString(\"links\"));\n                                assetVul.setPayload(JSONObject.toJSONString(json.getJSONObject(\"value\").getJSONObject(\"proof\").getJSONArray(\"steps\")));\n                                assetVul.setSeverity(\"high\");\n                                assetVulList.add(assetVul);\n                            }\n                        }\n                        ipOrWebOrSubDomainToVulDTO.setAssetVulList(assetVulList);\n                        sendService.sendResult(ipOrWebOrSubDomainToVulDTO);\n                    }\n                } else {\n                    sendService.INFO(\"Xpoc漏洞扫描执行成功，结果文件不存在，可能扫描结果为空！\");\n                }\n            } else {\n                sendService.ERROR(\"Xpoc漏洞扫描执行失败,状态码是:{},输出信息:{}\", result.getExitCode(), result.getOutput());\n            }\n        } catch (Exception e) {\n            throw new RuntimeException(e);\n        }\n        return null;\n    }\n\n}', 'java', 1, 'testnet-client', 'xpoc', 'VUL', 'xpoc help 2>&1 | grep -oP \'\\/v\\K\\d+\\.\\d+\\.\\d+\'', 1, '');
INSERT INTO `lite_flow_script` VALUES ('1816737017152946177', 'admin', '2024-05-01 00:00:00', 'admin', '2024-05-01 00:00:00', 'A01', '节点安装工具', 'script', 'import com.alibaba.fastjson.JSONObject;\r\nimport com.yomahub.liteflow.script.ScriptExecuteWrap;\r\nimport com.yomahub.liteflow.script.body.CommonScriptBody;\r\nimport com.yomahub.liteflow.spi.holder.ContextAwareHolder;\r\nimport org.apache.commons.lang.StringUtils;\r\nimport testnet.client.service.ILiteFlowMessageSendService;\r\nimport testnet.common.entity.liteflow.ClientToolVersion;\r\nimport testnet.common.entity.liteflow.TaskExecuteMessage;\r\nimport testnet.common.utils.CommandUtils;\r\nimport testnet.common.utils.FileUtils;\r\n\r\nimport java.io.IOException;\r\nimport java.util.UUID;\r\n\r\npublic class ToolsInstall implements CommonScriptBody {\r\n\r\n    private final ILiteFlowMessageSendService sendService;\r\n\r\n    public ToolsInstall() {\r\n        this.sendService = ContextAwareHolder.loadContextAware().getBean(ILiteFlowMessageSendService.class);\r\n    }\r\n\r\n    @Override\r\n    public Void body(ScriptExecuteWrap wrap) {\r\n        TaskExecuteMessage taskExecuteMessage = wrap.cmp.getRequestData();\r\n        sendService.setTaskId(taskExecuteMessage.getTaskId());\r\n        JSONObject params = JSONObject.parseObject(taskExecuteMessage.getTaskParams());\r\n        if (params == null) {\r\n            sendService.ERROR(\"工具安装失败！参数为空\");\r\n            return null;\r\n        }\r\n        String installCommand = params.getString(\"installCommand\");\r\n        String checkVersionCommand = params.getString(\"versionCheckCommand\");\r\n        try {\r\n            ClientToolVersion clientToolVersion = new ClientToolVersion();\r\n            String version = checkToolVersion(checkVersionCommand);\r\n            if (StringUtils.isBlank(version)) {\r\n                executeCommand(installCommand);\r\n                version = checkToolVersion(checkVersionCommand);\r\n                clientToolVersion.setToolVersion(version);\r\n                sendService.sendResult(clientToolVersion);\r\n            } else {\r\n                clientToolVersion.setToolVersion(version);\r\n                sendService.sendResult(clientToolVersion);\r\n                sendService.INFO(\"工具已存在，跳过安装。\");\r\n            }\r\n        } catch (Exception e) {\r\n            sendService.ERROR(\"工具安装过程中发生错误：\" + e.getMessage());\r\n            throw new RuntimeException(e);\r\n        }\r\n\r\n        return null;\r\n    }\r\n\r\n    private String checkToolVersion(String checkVersionCommand) {\r\n        String versionFileName = generateFileName();\r\n        FileUtils.createFileAndWrite(versionFileName, checkVersionCommand);\r\n\r\n        if (!FileUtils.fileExists(versionFileName)) {\r\n            sendService.ERROR(\"检查版本文件创建失败\");\r\n            return \"\";\r\n        }\r\n        CommandUtils.CommandResult versionResult = null;\r\n        try {\r\n            versionResult = CommandUtils.executeCommand(\"bash \" + versionFileName);\r\n            FileUtils.deleteFile(versionFileName);\r\n            sendService.INFO(\"开始检测工具版本\" + \"，命令是：\" + checkVersionCommand);\r\n            if (versionResult.getExitCode() == 0) {\r\n                if (StringUtils.isNotBlank(versionResult.getOutput())) {\r\n                    sendService.INFO(\"工具安装成功，版本是：\" + versionResult.getOutput());\r\n                    return versionResult.getOutput();\r\n                } else {\r\n                    sendService.INFO(\"工具未安装\");\r\n                    return \"\";\r\n                }\r\n            } else {\r\n                sendService.ERROR(\"工具版本检查失败，状态码是：\" + versionResult.getExitCode() + \",错误信息：\" + versionResult.getOutput());\r\n                return \"\";\r\n            }\r\n        } catch (Exception e) {\r\n            if (versionResult != null) {\r\n                sendService.ERROR(\"工具版本检查失败，错误信息：\" + e.getMessage() + \"输出信息：\", versionResult.getOutput());\r\n            }\r\n            return \"\";\r\n        }\r\n    }\r\n\r\n    private void executeCommand(String command) throws IOException, InterruptedException {\r\n        String fileName = generateFileName();\r\n        FileUtils.createFileAndWrite(fileName, command);\r\n\r\n        if (!FileUtils.fileExists(fileName)) {\r\n            sendService.ERROR(\"文件创建失败：\" + fileName);\r\n            return;\r\n        }\r\n        sendService.INFO(\"开始安装工具\" + \"，命令是：\" + command);\r\n        CommandUtils.CommandResult result = CommandUtils.executeCommand(\"bash \" + fileName);\r\n        FileUtils.deleteFile(fileName);\r\n\r\n        if (result.getExitCode() == 0) {\r\n            sendService.INFO(\"工具安装成功，开始检查版本\");\r\n        } else {\r\n            sendService.ERROR(\"工具安装失败,状态码是：\" + result.getExitCode() + \",错误信息：\" + result.getOutput());\r\n        }\r\n    }\r\n\r\n    private String generateFileName() {\r\n        return UUID.randomUUID().toString() + \".sh\";\r\n    }\r\n}', 'java', 1, 'testnet-client', 'install_tools', 'SYSTEM', NULL, 0, NULL);
INSERT INTO `lite_flow_script` VALUES ('1817575106689097730', 'admin', '2024-05-01 00:00:00', 'admin', '2024-05-01 00:00:00', 'A01', 'RustScan端口扫描', 'script', 'import com.alibaba.fastjson.JSONObject;\nimport com.yomahub.liteflow.script.ScriptExecuteWrap;\nimport com.yomahub.liteflow.script.body.CommonScriptBody;\nimport com.yomahub.liteflow.spi.holder.ContextAwareHolder;\nimport org.apache.commons.lang.StringUtils;\nimport testnet.client.service.ILiteFlowMessageSendService;\nimport testnet.common.dto.IpOrSubDomainToPortDTO;\nimport testnet.common.entity.liteflow.TaskExecuteMessage;\nimport testnet.common.utils.CommandUtils;\n\nimport java.util.ArrayList;\nimport java.util.List;\nimport java.util.UUID;\nimport java.util.regex.Matcher;\nimport java.util.regex.Pattern;\n\n\n/**\n * 脚本名称：RustScan 端口扫描\n * 适用资产：子域名、IP\n * 配置：\n * command: \'/testnet-client/tools/rustscan -a %s -p 80,443,22,21,23,25,53,110,143,161,389,445,587,3306,3389,8080,8443,53,137,139,445,993,995,1723,111,5900,5901,3128,8081,8082,9090,10000,10001 -g\'\n * 结果处理类名: ipOrSubDomainToPortProcessor\n */\npublic class RustScan implements CommonScriptBody {\n\n    public Void body(ScriptExecuteWrap wrap) {\n        // 获取的是chain初始化的参数\n        TaskExecuteMessage taskExecuteMessage = wrap.cmp.getRequestData();\n        try {\n            ILiteFlowMessageSendService messageSendService = ContextAwareHolder.loadContextAware().getBean(ILiteFlowMessageSendService.class);\n            messageSendService.setTaskId(taskExecuteMessage.getTaskId());\n            JSONObject config = JSONObject.parseObject(taskExecuteMessage.getConfig());\n            JSONObject instanceParams = JSONObject.parseObject(taskExecuteMessage.getTaskParams());\n            String resultPath = taskExecuteMessage.getResultPath() + \"rustscan_\" + UUID.randomUUID() + \".json\";\n            messageSendService.INFO(\"结果保存路径:{}\", resultPath);\n            String command = config.getString(\"command\");\n            String ip = \"\";\n            String domain = \"\";\n            switch (taskExecuteMessage.getAssetType()) {\n                case \"ip\":\n                    ip = instanceParams.getString(\"ip\");\n                    break;\n                case \"sub_domain\":\n                    domain = instanceParams.getString(\"subDomain\");\n                    break;\n            }\n            if (StringUtils.isNotBlank(domain)) {\n                command = String.format(command, domain, resultPath);\n            } else {\n                command = String.format(command, ip, resultPath);\n            }\n            messageSendService.INFO(\"开始执行RustScan端口扫描,命令是:{}\", command);\n            CommandUtils.CommandResult result = CommandUtils.executeCommand(command);\n            if (result.getExitCode() == 0) {\n                IpOrSubDomainToPortDTO dto = new IpOrSubDomainToPortDTO();\n                List<IpOrSubDomainToPortDTO.Port> portList = new ArrayList<>();\n                messageSendService.INFO(\"RustScan端口扫描执行结果:{}\", result.getOutput());\n                Pattern pattern = Pattern.compile(\"(\\\\d+\\\\.\\\\d+\\\\.\\\\d+\\\\.\\\\d+) -> \\\\[(.*?)\\\\]\");\n                Matcher matcher = pattern.matcher(result.getOutput());\n                while (matcher.find()) {\n                    String resultIp = matcher.group(1); // IP地址\n                    String ports = matcher.group(2); // 端口号列表\n                    for (int i = 0; i < ports.split(\",\").length; i++) {\n                        IpOrSubDomainToPortDTO.Port port = new IpOrSubDomainToPortDTO.Port();\n                        port.setIp(resultIp);\n                        port.setPort(Integer.parseInt(ports.split(\",\")[i]));\n                        port.setHost(domain);\n                        portList.add(port);\n                    }\n                }\n                dto.setPortList(portList);\n                messageSendService.sendResult(dto);\n            } else if (result.getExitCode() == 1) {\n                messageSendService.INFO(\"资产: {} 端口扫描完成，没有端口开放\");\n            } else {\n                messageSendService.ERROR(\"RustScan端口扫描执行失败,错误信息是:{}\", result.getExitCode());\n            }\n        } catch (Exception e) {\n            throw new RuntimeException(e);\n        }\n        return null;\n    }\n}', 'java', 1, 'testnet-client', 'rust_scan', 'PORT', 'rustscan -V 2>&1 | grep -oP \'rustscan \\K\\d+\\.\\d+\\.\\d+\'', 1, '');
INSERT INTO `lite_flow_script` VALUES ('1817837720312664066', 'admin', '2024-05-01 00:00:00', 'admin', '2024-05-01 00:00:00', 'A01', 'afrog漏洞扫描', 'script', 'import com.alibaba.fastjson.JSON;\nimport com.alibaba.fastjson.JSONArray;\nimport com.alibaba.fastjson.JSONObject;\nimport com.yomahub.liteflow.script.ScriptExecuteWrap;\nimport com.yomahub.liteflow.script.body.CommonScriptBody;\nimport com.yomahub.liteflow.spi.holder.ContextAwareHolder;\nimport testnet.client.service.ILiteFlowMessageSendService;\nimport testnet.common.dto.IpOrWebOrSubDomainToVulDTO;\nimport testnet.common.entity.liteflow.TaskExecuteMessage;\nimport testnet.common.utils.CommandUtils;\nimport testnet.common.utils.FileUtils;\n\nimport java.nio.file.Files;\nimport java.nio.file.Paths;\nimport java.util.ArrayList;\nimport java.util.List;\nimport java.util.UUID;\n\n/**\n * 脚本名称：Afrog漏洞扫描\n * 适用资产：WEB、子域名、ip\n * 配置：\n * command: \'afrog  -t %s -json %s\'\n * 结果处理类名: ipOrWebOrSubDomainToVulProcessor\n */\n\npublic class Afrog implements CommonScriptBody {\n\n    public Void body(ScriptExecuteWrap wrap) {\n        TaskExecuteMessage taskExecuteMessage =wrap.cmp.getRequestData();\n        JSONObject instanceParams = JSONObject.parseObject(taskExecuteMessage.getTaskParams());\n        JSONObject config = JSONObject.parseObject(taskExecuteMessage.getConfig());\n        ILiteFlowMessageSendService sendService = ContextAwareHolder.loadContextAware().getBean(ILiteFlowMessageSendService.class);\n        try {\n            sendService.setTaskId(taskExecuteMessage.getTaskId());\n            String resultPath = taskExecuteMessage.getResultPath() + \"afrog_\" + UUID.randomUUID() + \".json\";\n            sendService.INFO(\"结果保存路径:{}\", resultPath);\n            String command = config.getString(\"command\");\n            String asset = \"\";\n            switch (taskExecuteMessage.getAssetType()) {\n                case \"ip\":\n                    asset = instanceParams.getString(\"ip\");\n                    break;\n                case \"web\":\n                    asset = instanceParams.getString(\"webUrl\");\n                    break;\n                case \"sub_domain\":\n                    asset = instanceParams.getString(\"subDomain\");\n                    break;\n            }\n            command = String.format(command, asset, resultPath);\n            sendService.INFO(\"开始执行Afrog漏洞扫描,命令是：{}\", command);\n            CommandUtils.CommandResult result = CommandUtils.executeCommand(command);\n            if (result.getExitCode() == 0) {\n                if (FileUtils.fileExists(resultPath)) {\n                    String content = new String(Files.readAllBytes(Paths.get(resultPath)));\n                    JSONArray jsonArray = JSON.parseArray(content);\n                    if (jsonArray != null) {\n                        sendService.INFO(\"Afrog漏洞扫描成功，结果是：\" + content);\n                        IpOrWebOrSubDomainToVulDTO ipOrWebOrSubDomainToVulDTO = getIpOrWebOrSubDomainToVulDTO(jsonArray);\n                        sendService.sendResult(ipOrWebOrSubDomainToVulDTO);\n                    }\n                } else {\n                    sendService.INFO(\"Afrog漏洞扫描执行成功，结果文件不存在，可能扫描结果为空！\");\n                }\n            } else {\n                sendService.ERROR(\"Afrog漏洞扫描执行失败,状态码是:{},输出信息:{}\", result.getExitCode(), result.getOutput());\n            }\n        } catch (Exception e) {\n            sendService.ERROR(\"Afrog漏洞扫描执行失败,错误信息:{}\", e.getMessage());\n            throw new RuntimeException(e);\n        }\n        return null;\n    }\n\n    private IpOrWebOrSubDomainToVulDTO getIpOrWebOrSubDomainToVulDTO(JSONArray jsonArray) {\n        IpOrWebOrSubDomainToVulDTO ipOrWebOrSubDomainToVulDTO = new IpOrWebOrSubDomainToVulDTO();\n        List<IpOrWebOrSubDomainToVulDTO.AssetVul> assetVulList = new ArrayList<>();\n        for (Object o : jsonArray) {\n            JSONObject jsonObject = (JSONObject) o;\n            IpOrWebOrSubDomainToVulDTO.AssetVul assetVul = new IpOrWebOrSubDomainToVulDTO.AssetVul();\n            JSONObject info = jsonObject.getJSONObject(\"pocinfo\");\n            if (info != null) {\n                assetVul.setVulName(info.getString(\"infoname\"));\n                assetVul.setSeverity(info.getString(\"infoseg\"));\n                assetVul.setVulDesc(info.getString(\"infodescription\"));\n            }\n            if (jsonObject.getString(\"request\") != null) {\n                assetVul.setRequestBody(jsonObject.getString(\"request\"));\n            }\n            if (jsonObject.getString(\"response\") != null) {\n                assetVul.setResponseBody(jsonObject.getString(\"response\"));\n            }\n            if (jsonObject.getString(\"fulltarget\") != null) {\n                assetVul.setVulUrl(jsonObject.getString(\"fulltarget\"));\n            }\n            if (jsonObject.getJSONArray(\"pocresult\") != null && jsonObject.getJSONArray(\"pocresult\").size() > 1) {\n                assetVul.setRequestBody(jsonObject.getJSONArray(\"pocresult\").getString(0));\n                assetVul.setResponseBody(jsonObject.getJSONArray(\"pocresult\").getString(1));\n            }\n            assetVulList.add(assetVul);\n        }\n        ipOrWebOrSubDomainToVulDTO.setAssetVulList(assetVulList);\n        return ipOrWebOrSubDomainToVulDTO;\n    }\n\n}', 'java', 1, 'testnet-client', 'afrog', 'VUL', 'afrog --version 2>&1| grep \"Version\" | cut -d \' \' -f 3', 1, '');
INSERT INTO `lite_flow_script` VALUES ('1820078397037608961', 'admin', '2024-05-01 00:00:00', 'admin', '2024-05-01 00:00:00', 'A01', '空间引擎一键导入', 'script', 'import com.alibaba.fastjson.JSONObject;\nimport com.yomahub.liteflow.script.ScriptExecuteWrap;\nimport com.yomahub.liteflow.script.body.CommonScriptBody;\nimport com.yomahub.liteflow.spi.holder.ContextAwareHolder;\nimport testnet.client.service.ILiteFlowMessageSendService;\nimport testnet.common.dto.SearchEngineImportDTO;\nimport testnet.common.entity.liteflow.TaskExecuteMessage;\n\n\npublic class SearchEngine implements CommonScriptBody {\n    public Void body(ScriptExecuteWrap wrap) {\n        TaskExecuteMessage taskExecuteMessage = (TaskExecuteMessage) wrap.cmp.getRequestData();\n        try {\n            ILiteFlowMessageSendService sendService = (ILiteFlowMessageSendService) ContextAwareHolder.loadContextAware().getBean(ILiteFlowMessageSendService.class);\n            sendService.setTaskId(taskExecuteMessage.getTaskId());\n            JSONObject instanceParams = JSONObject.parseObject(taskExecuteMessage.getTaskParams());\n            SearchEngineImportDTO searchEngineImportDTO = new SearchEngineImportDTO();\n            searchEngineImportDTO.setCurrentPage(instanceParams.getInteger(\"currentPage\"));\n            sendService.sendResult(searchEngineImportDTO);\n        } catch (Exception e) {\n            throw new RuntimeException(e);\n        }\n        return null;\n    }\n}', 'java', 1, 'testnet-client', 'search_engine', 'SYSTEM', NULL, 0, NULL);
INSERT INTO `lite_flow_script` VALUES ('1838155243516059649', 'admin', '2024-05-01 00:00:00', 'admin', '2024-05-01 00:00:00', 'A01', '检测IP是否存在防火墙', 'script', 'import com.alibaba.fastjson.JSONObject;\nimport com.yomahub.liteflow.script.ScriptExecuteWrap;\nimport com.yomahub.liteflow.script.body.CommonScriptBody;\nimport com.yomahub.liteflow.spi.holder.ContextAwareHolder;\nimport testnet.client.service.ILiteFlowMessageSendService;\nimport testnet.common.dto.AssetUpdateDTO;\nimport testnet.common.dto.IpOrSubDomainToPortDTO;\nimport testnet.common.entity.liteflow.TaskExecuteMessage;\nimport testnet.common.utils.CommandUtils;\n\nimport java.io.BufferedReader;\nimport java.io.FileReader;\nimport java.nio.file.Paths;\nimport java.util.ArrayList;\nimport java.util.Collections;\nimport java.util.List;\nimport java.util.UUID;\n\n\n/**\n * 脚本名称：Naabu 防火墙探测\n * 适用资产：子域名、IP\n * 配置：\n * command: \'naabu -no-stdin -c 200 -json -host %s -o %s -verify\'\n * 结果处理类名: assetUpdateProcessor\n * 原理：随机探测3个TCP端口，大于2个端口开放则说明可能存在防火墙\n */\npublic class PortFirewall implements CommonScriptBody {\n\n    private static final int MIN_PORT = 20000;\n    private static final int MAX_PORT = 60000;\n    private static final int PORT_COUNT = 3;\n    private ILiteFlowMessageSendService messageSendService;\n\n    public Void body(ScriptExecuteWrap wrap) {\n        // 获取的是chain初始化的参数\n        TaskExecuteMessage taskExecuteMessage = wrap.cmp.getRequestData();\n        try {\n            messageSendService = ContextAwareHolder.loadContextAware().getBean(ILiteFlowMessageSendService.class);\n            messageSendService.setTaskId(taskExecuteMessage.getTaskId());\n            JSONObject config = JSONObject.parseObject(taskExecuteMessage.getConfig());\n            JSONObject instanceParams = JSONObject.parseObject(taskExecuteMessage.getTaskParams());\n            String resultPath = taskExecuteMessage.getResultPath() + \"naabu_\" + UUID.randomUUID() + \".json\";\n            messageSendService.INFO(\"结果保存路径:{}\", resultPath);\n            String command = config.getString(\"command\");\n            String asset = \"\";\n            switch (taskExecuteMessage.getAssetType()) {\n                case \"ip\":\n                    asset = instanceParams.getString(\"ip\");\n                    break;\n                case \"sub_domain\":\n                    asset = instanceParams.getString(\"subDomain\");\n                    break;\n            }\n            command = String.format(command, getRandomPorts(), asset, resultPath);\n            messageSendService.INFO(\"开始执行Nabbu防火墙探测,命令是:{}\", command);\n            CommandUtils.CommandResult result = CommandUtils.executeCommand(command);\n            if (result.getExitCode() == 0) {\n                BufferedReader reader = new BufferedReader(new FileReader(Paths.get(resultPath).toFile()));\n                String line;\n                List<IpOrSubDomainToPortDTO.Port> portList = new ArrayList<>();\n                int resultCount = 0;\n                while ((line = reader.readLine()) != null) {\n                    // 处理每一行内容\n                    JSONObject jsonObject = JSONObject.parseObject(line);\n                    messageSendService.INFO(\"Nabbu端口扫描执行结果:{}\", jsonObject);\n                    resultCount = resultCount + 1;\n                }\n                if (resultCount >= 2) {\n                    messageSendService.INFO(\"资产: {} 端口扫描完成，端口开放数量: {}, 可能存在防火墙\", asset, resultCount);\n                    instanceParams.put(\"assetLabel\", \"防火墙\");\n                    AssetUpdateDTO assetUpdateDTO = new AssetUpdateDTO();\n                    assetUpdateDTO.setData(instanceParams.toString());\n                    messageSendService.sendResult(assetUpdateDTO);\n                } else {\n                    messageSendService.INFO(\"资产: {} 端口扫描完成，端口开放数量: {}, 不存在防火墙\", asset, resultCount);\n                }\n            } else if (result.getExitCode() == 1) {\n                messageSendService.INFO(\"资产: {} 端口扫描完成，没有端口开放, 不存在防火墙\", asset);\n            } else {\n                messageSendService.ERROR(\"Nabbu端口扫描执行失败,错误信息是:{}\", result.getExitCode());\n            }\n        } catch (Exception e) {\n            throw new RuntimeException(e);\n        }\n        return null;\n    }\n\n    private String getRandomPorts() {\n\n        List<Integer> ports = new ArrayList<>();\n        for (int i = MIN_PORT; i <= MAX_PORT; i++) {\n            ports.add(i);\n        }\n        Collections.shuffle(ports);\n        List<Integer> selectedPorts = ports.subList(0, PORT_COUNT);\n        StringBuilder result = new StringBuilder();\n        for (int i = 0; i < selectedPorts.size(); i++) {\n            if (i > 0) {\n                result.append(\",\");\n            }\n            result.append(selectedPorts.get(i));\n        }\n        messageSendService.INFO(\"随机选择的端口是:{}\", result);\n        return result.toString();\n    }\n}', 'java', 1, 'testnet-client', 'port_firewall', 'PORT', 'naabu -version 2>&1 | grep -oP \'Current Version: \\K\\d+\\.\\d+\\.\\d+\'', 1, '');
INSERT INTO `lite_flow_script` VALUES ('1864592945601769473', 'admin', '2024-05-01 00:00:00', 'admin', '2024-05-01 00:00:00', 'A01', 'WebInfoHunter敏感信息扫描', 'script', 'import com.alibaba.fastjson.JSON;\nimport com.alibaba.fastjson.JSONArray;\nimport com.alibaba.fastjson.JSONObject;\nimport com.yomahub.liteflow.script.ScriptExecuteWrap;\nimport com.yomahub.liteflow.script.body.CommonScriptBody;\nimport com.yomahub.liteflow.spi.holder.ContextAwareHolder;\nimport testnet.client.service.ILiteFlowMessageSendService;\nimport testnet.common.dto.IpOrWebOrSubDomainToVulDTO;\nimport testnet.common.entity.liteflow.TaskExecuteMessage;\nimport testnet.common.utils.CommandUtils;\nimport testnet.common.utils.FileUtils;\n\nimport java.nio.file.Files;\nimport java.nio.file.Paths;\nimport java.util.ArrayList;\nimport java.util.List;\nimport java.util.UUID;\n\n/**\n * 脚本名称：WebInfoHunter敏感信息扫描\n * 适用资产：WEB、子域名、ip\n * 配置：\n * command: \'wih -t %s -J -o %s -r /testnet-client/tools/rules.yml --dc\'\n * 结果处理类名: ipOrWebOrSubDomainToVulProcessor\n */\n\npublic class WebInfoHunter implements CommonScriptBody {\n\n    public Void body(ScriptExecuteWrap wrap) {\n        TaskExecuteMessage taskExecuteMessage = wrap.cmp.getRequestData();\n        JSONObject instanceParams = JSONObject.parseObject(taskExecuteMessage.getTaskParams());\n        JSONObject config = JSONObject.parseObject(taskExecuteMessage.getConfig());\n        try {\n            ILiteFlowMessageSendService sendService = ContextAwareHolder.loadContextAware().getBean(ILiteFlowMessageSendService.class);\n            sendService.setTaskId(taskExecuteMessage.getTaskId());\n            String resultPath = taskExecuteMessage.getResultPath() + \"wih_\" + UUID.randomUUID() + \".json\";\n            sendService.INFO(\"结果保存路径:{}\", resultPath);\n            String command = config.getString(\"command\");\n            String asset = \"\";\n            switch (taskExecuteMessage.getAssetType()) {\n                case \"ip\":\n                    asset = instanceParams.getString(\"ip\");\n                    break;\n                case \"web\":\n                    asset = instanceParams.getString(\"webUrl\");\n                    break;\n                case \"sub_domain\":\n                    asset = instanceParams.getString(\"subDomain\");\n                    break;\n            }\n            command = String.format(command, asset, resultPath);\n            sendService.INFO(\"开始执行Wih敏感信息扫描,命令是：{}\", command);\n            CommandUtils.CommandResult result = CommandUtils.executeCommand(command);\n            if (result.getExitCode() == 0) {\n                if (FileUtils.fileExists(resultPath)) {\n                    String content = new String(Files.readAllBytes(Paths.get(resultPath)));\n                    JSONObject jsonObject = JSONObject.parseObject(content);\n                    JSONArray jsonArray = jsonObject.getJSONArray(\"records\");\n                    if (jsonArray != null) {\n                        IpOrWebOrSubDomainToVulDTO ipOrWebOrSubDomainToVulDTO = new IpOrWebOrSubDomainToVulDTO();\n                        List<IpOrWebOrSubDomainToVulDTO.AssetVul> assetVulList = new ArrayList<>();\n                        for (Object o : jsonArray) {\n                            JSONObject json = (JSONObject) o;\n                            sendService.INFO(\"wih敏感信息扫描发现漏洞，结果是：\" + json);\n                            IpOrWebOrSubDomainToVulDTO.AssetVul assetVul = new IpOrWebOrSubDomainToVulDTO.AssetVul();\n                            assetVul.setVulName(json.getString(\"id\") + \"敏感信息泄漏: \" + json.getString(\"content\"));\n                            assetVul.setVulDesc(\"wih发现敏感信息泄漏\");\n                            assetVul.setVulUrl(json.getString(\"source\"));\n                            assetVul.setPayload(json.getString(\"content\"));\n                            assetVul.setSeverity(\"high\");\n                            assetVulList.add(assetVul);\n                        }\n                        ipOrWebOrSubDomainToVulDTO.setAssetVulList(assetVulList);\n                        sendService.sendResult(ipOrWebOrSubDomainToVulDTO);\n                    }\n                } else {\n                    sendService.INFO(\"wih敏感信息扫描执行成功，结果文件不存在，可能扫描结果为空！\");\n                }\n            } else {\n                sendService.ERROR(\"wih敏感信息扫描执行失败,状态码是:{},输出信息:{}\", result.getExitCode(), result.getOutput());\n            }\n        } catch (Exception e) {\n            throw new RuntimeException(e);\n        }\n        return null;\n    }\n\n}', 'java', 1, 'testnet-client', 'wih', 'VUL', 'wih --version 2>&1 | grep -oP \'version: \\Kv\\d+\\.\\d+\\.\\d+(-\\w+)*\'', 1, '');
INSERT INTO `lite_flow_script` VALUES ('1864609136374378497', 'admin', '2024-05-01 00:00:00', 'admin', '2024-05-01 00:00:00', 'A01', 'URLFinder', 'script', 'import com.alibaba.fastjson.JSONArray;\nimport com.alibaba.fastjson.JSONObject;\nimport com.yomahub.liteflow.script.ScriptExecuteWrap;\nimport com.yomahub.liteflow.script.body.CommonScriptBody;\nimport com.yomahub.liteflow.spi.holder.ContextAwareHolder;\nimport testnet.client.service.ILiteFlowMessageSendService;\nimport testnet.common.dto.AssetApiToApiDTO;\nimport testnet.common.entity.liteflow.TaskExecuteMessage;\nimport testnet.common.utils.CommandUtils;\nimport testnet.common.utils.FileUtils;\n\nimport java.nio.file.Files;\nimport java.nio.file.Paths;\nimport java.util.ArrayList;\nimport java.util.List;\nimport java.util.UUID;\n\n/**\n * 脚本名称：URLFinder路径扫描\n * 适用资产：API\n * command: \'URLFinder -u %s -o %s\'\n * 结果处理类名: ApiToApiProcessor\n */\n\npublic class URLFinder implements CommonScriptBody {\n    private List<AssetApiToApiDTO.AssetApiDTO> assetApiDTOList = new ArrayList<>();\n\n    public Void body(ScriptExecuteWrap wrap) {\n        TaskExecuteMessage taskExecuteMessage = wrap.cmp.getRequestData();\n        try {\n            ILiteFlowMessageSendService sendService = ContextAwareHolder.loadContextAware().getBean(ILiteFlowMessageSendService.class);\n            sendService.setTaskId(taskExecuteMessage.getTaskId());\n            JSONObject config = JSONObject.parseObject(taskExecuteMessage.getConfig());\n            String command = config.getString(\"command\");\n            String resultPath = taskExecuteMessage.getResultPath() + \"urlfinder_\" + UUID.randomUUID() + \".json\";\n            sendService.INFO(\"结果保存路径:{}\", resultPath);\n            JSONObject instanceParams = JSONObject.parseObject(taskExecuteMessage.getTaskParams());\n            String webUrl = instanceParams.getString(\"absolutePath\");\n            command = String.format(command, webUrl, resultPath);\n            sendService.INFO(\"开始执行URLFinder路径扫描,命令是:{}\", command);\n            CommandUtils.CommandResult result = CommandUtils.executeCommand(command);\n            if (result.getExitCode() == 0) {\n                if (FileUtils.fileExists(resultPath)) {\n                    String content = new String(Files.readAllBytes(Paths.get(resultPath)));\n                    // sendService.INFO(\"URLFinder工具扫描执行结果:{}\", content);\n                    JSONObject jsonObject = JSONObject.parseObject(content);\n                    JSONArray url = jsonObject.getJSONArray(\"url\");\n                    JSONArray urlOther = jsonObject.getJSONArray(\"urlOther\");\n                    processResult(url);\n                    processResult(urlOther);\n                    if (!assetApiDTOList.isEmpty()) {\n                        AssetApiToApiDTO assetApiToApiDTO = new AssetApiToApiDTO();\n                        assetApiToApiDTO.setAssetApiDTOList(assetApiDTOList);\n                        sendService.sendResult(assetApiToApiDTO);\n                    }\n                } else {\n                    sendService.INFO(\"URLFinder工具扫描执行成功，结果文件为空\");\n                }\n            } else {\n                sendService.ERROR(\"URLFinder工具扫描执行失败,状态码是:{},输出信息:{}\", result.getExitCode(), result.getOutput());\n            }\n        } catch (Exception e) {\n            throw new RuntimeException(e);\n        }\n        return null;\n    }\n\n    private void processResult(JSONArray urlOther) {\n        if (urlOther != null) {\n            for (Object o : urlOther) {\n                JSONObject json = (JSONObject) o;\n                AssetApiToApiDTO.AssetApiDTO assetApiDTO = new AssetApiToApiDTO.AssetApiDTO();\n                assetApiDTO.setHttpMethod(\"GET\");\n                assetApiDTO.setAbsolutePath(json.getString(\"Url\"));\n                assetApiDTO.setTitle(json.getString(\"Title\"));\n                assetApiDTOList.add(assetApiDTO);\n            }\n        }\n    }\n}', 'java', 1, 'testnet-client', 'urlfinder', 'CRAWLER', 'URLFinder 2>&1 | grep -oP \'Update: \\K\\d+\\.\\d+\\.\\d+\'', 1, NULL);
