INSERT INTO `onl_cgreport_head` VALUES ('1260179852088135681', 'tj_user_report', '统一有效系统用户', 'select id,realname,username,sex,birthday,avatar,phone,email from sys_user', NULL, NULL, '1', NULL, NULL, NULL, '2022-11-07 19:09:25', 'admin', '2020-05-12 20:07:44', 'admin');
INSERT INTO `onl_cgreport_head` VALUES ('1590154651759259649', 'withparamreport', '带参数报表', 'select * from demo where sex = \'${sex}\'', NULL, NULL, '1', NULL, NULL, NULL, '2022-11-09 14:38:04', 'admin', '2022-11-09 09:29:47', 'admin');
INSERT INTO `onl_cgreport_head` VALUES ('1704050170711601153', 'asset_label_list', '资产标签', 'select id,label_name from asset_label', NULL, NULL, '1', 'local_mysql', NULL, NULL, '2024-04-09 21:20:07', 'admin', '2023-09-19 16:29:55', 'admin');
INSERT INTO `onl_cgreport_head` VALUES ('1704058232528793602', 'asset_domain_list', '域名报表', 'SELECT \n    ad.id,\n    ad.domain,\n    ad.project_id,\n    ad.icp_number,\n    ad.whois,\n    ac.company_name,\n    p.project_name\nFROM\n    asset_domain ad\n    LEFT JOIN asset_company ac ON ad.company_id = ac.id\n    LEFT JOIN project p ON ad.project_id = p.id', NULL, NULL, '1', 'local_mysql', NULL, NULL, '2024-03-28 12:06:05', 'admin', '2023-09-19 17:01:57', 'admin');
INSERT INTO `onl_cgreport_head` VALUES ('1785143295344988162', 'port_list', '端口+IP+域名', 'SELECT \nai.ip,\nap.port,\nap.id,\np.project_name\nFROM asset_port as ap \nLEFT JOIN asset_ip as ai ON ap.ip = ai.id\nLEFT JOIN project p ON ap.project_id = p.id', NULL, NULL, '1', NULL, NULL, NULL, '2024-07-09 21:31:26', 'admin', '2024-04-30 11:05:03', 'admin');
INSERT INTO `onl_cgreport_head` VALUES ('1788550043107893249', 'asset_ip_list', 'ip列表', 'SELECT \n  asd.sub_domain,\n  ai.ip,\n  ai.project_id,\n  ai.id AS ai_id, \n  asd.id AS asd_id \nFROM \n  asset_ip AS ai \nLEFT JOIN \n  asset_ip_sub_domain AS aisd ON ai.id = aisd.ip_id \nLEFT JOIN \n  asset_sub_domain AS asd  ON asd.id = aisd.subdomain_id', NULL, NULL, '1', 'local_mysql', NULL, NULL, '2024-05-10 15:26:06', 'admin', '2024-05-09 20:42:15', 'admin');
INSERT INTO `onl_cgreport_head` VALUES ('1810618831735099393', 'select_domain', '域名列表', 'SELECT \n    ad.id,\n    ad.domain,\n    ad.project_id,\n    ac.company_name,\n    p.project_name\nFROM\n    asset_domain ad\n    LEFT JOIN asset_company ac ON ad.company_id = ac.id\n    LEFT JOIN project p ON ad.project_id = p.id', NULL, NULL, '1', NULL, NULL, NULL, '2024-07-09 18:25:42', 'admin', '2024-07-09 18:15:44', 'admin');
INSERT INTO `onl_cgreport_head` VALUES ('1810621988796108801', 'select_ip', 'IP列表', 'SELECT \n  ai.ip,\n  ai.project_id,\n  ai.id AS ai_id, \n  p.project_name AS project_name\nFROM \n  asset_ip AS ai \nLEFT JOIN \n  project p ON ai.project_id = p.id', NULL, NULL, '1', NULL, NULL, NULL, '2024-07-09 18:28:48', 'admin', '2024-07-09 18:28:17', 'admin');
INSERT INTO `onl_cgreport_head` VALUES ('1810653245177409538', 'select_sub_domain', '子域名列表', 'select \nasd.id as id,\np.id as project_id,\nasd.sub_domain as sub_domain,\np.project_name as project_name \nfrom asset_sub_domain asd\nLEFT JOIN project p ON asd.project_id = p.id', NULL, NULL, '1', NULL, NULL, NULL, NULL, NULL, '2024-07-09 20:32:29', 'admin');
INSERT INTO `onl_cgreport_head` VALUES ('1810660458881134594', 'select_company', '公司列表', 'select \nac.id as company_id,\nac.company_name,\np.id as project_id,\np.project_name \nfrom asset_company ac \nleft join project p ON ac.project_id = p.id', NULL, NULL, '1', NULL, NULL, NULL, '2024-07-09 21:05:07', 'admin', '2024-07-09 21:01:08', 'admin');
INSERT INTO `onl_cgreport_head` VALUES ('1810992903413395458', 'select_port', '端口列表', 'SELECT \n    ai.ip,\n    ap.port,\n    ap.id,\n    p.project_name,\n    CONCAT(ai.ip, \':\', ap.port) AS ip_port\nFROM asset_port AS ap\nLEFT JOIN asset_ip AS ai ON ap.ip = ai.id\nLEFT JOIN project AS p ON ap.project_id = p.id', NULL, NULL, '1', NULL, NULL, NULL, '2024-07-10 19:05:33', 'admin', '2024-07-10 19:02:09', 'admin');
INSERT INTO `onl_cgreport_head` VALUES ('1811027883992641537', 'select_api_tree', 'API列表', 'select \nid,\nabsolute_path\nfrom asset_api_tree \nwhere pid = \'0\'', NULL, NULL, '1', NULL, NULL, NULL, '2024-07-11 19:50:54', 'admin', '2024-07-10 21:21:09', 'admin');
